INSERT INTO `products` (`id`, `code`, `category_id`, `name`, `description`, `price`, `featured_image`, `quantity`, `discount`, `slug`, `status`, `featured`, `color`, `screen_technology`, `os`, `cpu`, `resolution`, `front_camera`, `rear_camera`, `ram`, `rom`, `sim`, `pin`, `view_count`, `created_at`, `updated_at`) VALUES
(40, 'EG224253', 15, 'Điện thoại Samsung Galaxy A34 5G 8GB/128GB Xanh', '<h3><strong>Thiết kế liền mạch tối giản, m&agrave;u sắc thời thượng &ldquo;bật&rdquo; chất trẻ</strong></h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/tim-kiem.html?tu-khoa=%C4%91i%E1%BB%87n+tho%E1%BA%A1i+samsung+Galaxy\">Điện thoại Samsung Galaxy</a>&nbsp;A34 5G sở hữu th&acirc;n m&aacute;y si&ecirc;u mỏng nhẹ với trọng lượng chỉ khoảng 199g, d&agrave;y khoảng 8.2 mm, cho cảm gi&aacute;c cầm nắm vừa vặn v&agrave; thoải m&aacute;i. Đ&acirc;y ắt hẳn l&agrave; &ldquo;ch&acirc;n &aacute;i&rdquo; đối với c&aacute;c t&iacute;n đồ ưa x&ecirc; dịch, thường xuy&ecirc;n di chuyển n&ecirc;n cần những thiết bị mỏng nhẹ linh hoạt. Điện thoại được thiết kế nguy&ecirc;n khối với viền kim loại &ocirc;m trọn cụm camera một c&aacute;ch tinh tế, tạo n&ecirc;n tổng thể liền mạch trẻ trung nhưng cũng kh&ocirc;ng k&eacute;m phần sang trọng. Samsung A34 5G c&oacute; mặt lưng tr&aacute;ng gương hiện đại v&agrave; kho&aacute;c l&ecirc;n m&igrave;nh những gam m&agrave;u trẻ trung, đầy sức sống bao gồm:&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-samsung-galaxy-a34-5g-8gb-128gb-bac.html\">Bạc Bất Bại</a>,&nbsp;<a href=\"https://nguyenkim.com/dien-thoai-samsung-galaxy-a34-5g-8gb-128gb-xanh.html\">Xanh Dũng M&atilde;nh</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-samsung-galaxy-a34-5g-8gb-128gb-den.html\">Đen Chiến Binh</a>. C&aacute;c tone m&agrave;u nhẹ nh&agrave;ng m&agrave; A34 5G sở hữu cũng ch&iacute;nh l&agrave; xu hướng đương thời - tinh tế, thời thượng, ph&ugrave; hợp với mọi đối tượng bất kể độ tuổi v&agrave; giới t&iacute;nh,&nbsp;khiến ai nấy cũng phải &quot;xi&ecirc;u l&ograve;ng&quot; trước vẻ đẹp của ch&uacute;ng.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G mỏng nhẹ sang trọng\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-1.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Bộ 3 camera độ ph&acirc;n giải tới 48MP, thỏa sức s&aacute;ng tạo những tuyệt t&aacute;c ảnh đẹp chuy&ecirc;n nghiệp</h3>\r\n\r\n<p>Chi tiết đắt gi&aacute; tiếp theo đ&oacute; l&agrave; Galaxy A34 5G sở hữu th&ocirc;ng số camera v&ocirc; c&ugrave;ng ấn tượng với&nbsp;<a href=\"https://www.nguyenkim.com/cach-chup-anh-selfie-dep.html\">camera selfie</a>&nbsp;độ ph&acirc;n giải 13MP cho ảnh chụp ch&acirc;n dung đẹp tự nhi&ecirc;n. Ph&iacute;a sau l&agrave; bộ 3 camera, với camera ch&iacute;nh độ ph&acirc;n giải đến 48MP với điểm ảnh lớn gi&uacute;p chụp ảnh với độ sắc n&eacute;t cao v&agrave; m&agrave;u ảnh s&aacute;ng r&otilde;. C&ugrave;ng với đ&oacute; l&agrave; 1 camera chụp 8MP chụp g&oacute;c si&ecirc;u rộng l&ecirc;n đến 120 độ để bạn chụp to&agrave;n cảnh tốt, bắt trọn cảnh vật v&agrave;o khung h&igrave;nh. V&agrave; cuối c&ugrave;ng l&agrave; 1 camera Macro chụp cận cảnh 5MP với khả năng bắt chi tiết vật thể nhỏ ở khoảng c&aacute;ch chỉ từ 3 - 5cm . Th&ocirc;ng số camera n&agrave;y đủ để đảm bảo cho người d&ugrave;ng tạo n&ecirc;n mọi bức ảnh ho&agrave;n hảo d&ugrave; l&agrave; chụp ch&acirc;n dung, to&agrave;n cảnh hay cận cảnh.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G camera chụp hình tốt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-3.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh&nbsp;<a href=\"https://www.nguyenkim.com/man-hinh-amoled-la-gi-super-amoled-la-gi.html\">Super AMOLED</a>&nbsp;hiển thị r&otilde; dưới nắng ch&oacute;i</strong></h3>\r\n\r\n<p>Với độ s&aacute;ng tối đa l&ecirc;n đến 1000 nits, c&ugrave;ng trang bị m&agrave;n h&igrave;nh Super AMOLED cao cấp, Galaxy A34 5G cho khung h&igrave;nh hiển thị s&aacute;ng r&otilde; ngay cả ngo&agrave;i trời nắng. M&agrave;n h&igrave;nh lớn 6,6 inch c&ugrave;ng&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">độ ph&acirc;n giải Full HD+</a>&nbsp;mang lại trải nghiệm xem ch&acirc;n thực v&agrave; sống động.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G màn hình lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-5.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G tần số quét 120 Hz\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-7.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Tần số qu&eacute;t 120Hz, lướt chạm mượt m&agrave;</strong></h3>\r\n\r\n<p>D&ugrave; c&oacute; mức gi&aacute; tầm trung, nhưng A34 5G lại sở hữu tốc độ l&agrave;m mới m&agrave;n h&igrave;nh thuộc dạng &quot;khủng&quot; đến 120 Hz - ngang ngửa c&aacute;c d&ograve;ng&nbsp;<a href=\"https://www.nguyenkim.com/nhu-the-nao-la-mot-san-pham-flagship-ban-da-biet.html\">điện thoại Flagship cao cấp</a>. Với th&ocirc;ng số n&agrave;y, m&aacute;y mang đến trải nghiệm lướt web, xem phim, chơi game&hellip; cực&nbsp; &ldquo;m&atilde;n nh&atilde;n&rdquo; với khung h&igrave;nh mượt, hiển thị sắc n&eacute;t, độ tương phản cao.</p>\r\n\r\n<h3><strong>Hiệu năng ổn định, chinh chiến mọi tựa game</strong></h3>\r\n\r\n<p>Nhờ trang bị chip Dimensity 1080 hiệu năng cao, c&ugrave;ng dung lượng RAM 8GB, Galaxy A34 5G cho hiệu năng mạnh mẽ, xử l&yacute; mượt m&agrave; d&ugrave; mở c&ugrave;ng l&uacute;c nhiều ứng dụng. Với hiệu năng n&agrave;y, thiết bị cũng cho khả năng xem phim, lướt web,&nbsp;<a href=\"https://www.nguyenkim.com/game-kiem-tien-online.html\">chơi game</a>&nbsp;cực kỳ ổn định.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G hiệu năng ổn định\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-9.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G công nghệ âm thanh tiên tiến\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-11.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Đắm ch&igrave;m trong thế giới &acirc;m thanh đỉnh cao</strong></h3>\r\n\r\n<p>Samsung Galaxy A34 đưa trải nghiệm xem phim, nghe nhạc, chơi game l&ecirc;n tầm cao mới với&nbsp;<a href=\"https://www.nguyenkim.com/mang-ca-rap-phim-vao-ngoi-nha-cua-ban-nho-2-cong-nghe-dolby-atmos-va-dolby-vision-dot-pha-tren-tivi-oled-lg.html\">Dolby Atmos</a>&nbsp;- c&ocirc;ng nghệ &acirc;m thanh chuẩn điện ảnh, mang đến &acirc;m thanh đa sắc v&agrave; tr&agrave;n ngập khắp kh&ocirc;ng gian ngay tr&ecirc;n thiết bị di động nhỏ gọn tr&ecirc;n tay bạn.&nbsp;</p>\r\n\r\n<h3><strong>Kh&aacute;ng bụi, chống nước, an t&acirc;m trải nghiệm</strong></h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/dien-thoai-di-dong/\">Điện thoại</a>&nbsp;đạt chứng nhận chuẩn kh&aacute;ng nước &amp; kh&aacute;ng bụi IP67. Tức&nbsp;c&oacute; thể kh&aacute;ng nước độ s&acirc;u 1 m&eacute;t trong tối đa 30 ph&uacute;t. Do đ&oacute;, bạn ho&agrave;n to&agrave;n c&oacute; thể an t&acirc;m sử dụng ch&uacute;ng trong mọi ho&agrave;n cảnh, bất chấp thời tiết nắng mưa.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G kháng bụi, kháng nước\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-14.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G dung lượng pin cao\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-a34-5g-h8.png\" style=\"width:100%\" /></p>\r\n\r\n<h3>Vi&ecirc;n pin 5000mAh, bền bỉ suốt ng&agrave;y d&agrave;i</h3>\r\n\r\n<p>B&ecirc;n trong Galaxy A34 5G l&agrave; vi&ecirc;n pin dung lượng lớn đến 5000mAh (ti&ecirc;u chuẩn), cho tổng thời gian d&ugrave;ng k&eacute;o d&agrave;i tới 2 ng&agrave;y. Việc sạc pin cũng nhanh ch&oacute;ng hơn bao giờ hết khi m&aacute;y hỗ trợ c&ocirc;ng nghệ Sạc nhanh si&ecirc;u tốc 25W để bạn kh&ocirc;ng gi&aacute;n đoạn bất cứ c&ocirc;ng việc n&agrave;o.</p>\r\n\r\n<h3>Kết nối 5G, tốc độ vượt trội&nbsp;</h3>\r\n\r\n<p>Điện thoại Samsung t&iacute;ch hợp c&ocirc;ng nghệ&nbsp;<a href=\"https://www.nguyenkim.com/cach-kiem-tra-dien-thoai-co-ho-tro-5g-hay-khong.html\">kết nối 5G</a>, mở ra kỷ nguy&ecirc;n trải nghiệm mạng di động mới với tốc độ vượt trội cực đ&atilde; để người d&ugrave;ng chơi game, ph&aacute;t trực tuyến mượt m&agrave;, chia sẻ v&agrave; tải xuống mọi dữ liệu nhanh thần tốc.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G kết nối 5G\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-16.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G có cảm biến vân tay\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-17.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Mở kh&oacute;a tức th&igrave; với 1 lần chạm</h3>\r\n\r\n<p>Tăng cường khả năng bảo mật v&agrave; thao t&aacute;c mở kh&oacute;a cực kỳ nhanh ch&oacute;ng chỉ với 1 c&aacute;i chạm tay nhờ cảm biến v&acirc;n tay được t&iacute;ch hợp. Bạn sẽ nhanh ch&oacute;ng truy cập v&agrave;o điện thoại m&agrave; kh&ocirc;ng cần sợ ai đ&oacute; nh&ograve;m ng&oacute; v&ocirc; t&igrave;nh biết được mật khẩu của m&igrave;nh.</p>', 8490000, 'cc5b960610c4393f1d546e36906ac867.jpg', 95, 1300000, 'dien-thoai-samsung-galaxy-a34-5g-8gb128gb-xanh', 'active', 1, 'Xanh', 'Super AMOLED, 1000 nits, Eye-care giảm tới 50% ánh sáng xanh', 'Android 13, One UI 5', 'Dimensity 1080 – 5nm, (Octa Core 2 x 2.6GHz + 6 x 2.0GHz)', 'FHD+ pixels', '13MP (F2.2)', '48MP F1.8 OIS (Rộng); 8MP F2.2 (Siêu Rộng); 5MP F2.4 (Cận cảnh)', '8 GB', '128 GB', 'Nano SIM', '5000 mAh', 43, '2023-04-27 15:42:53', '2023-05-16 02:40:36'),
(41, 'JO231223', 15, 'Điện thoại Samsung Galaxy A34 5G 8GB/128GB Đen', '<h3><strong>Thiết kế liền mạch tối giản, m&agrave;u sắc thời thượng &ldquo;bật&rdquo; chất trẻ</strong></h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/tim-kiem.html?tu-khoa=%C4%91i%E1%BB%87n+tho%E1%BA%A1i+samsung+Galaxy\">Điện thoại Samsung Galaxy</a>&nbsp;A34 5G sở hữu th&acirc;n m&aacute;y si&ecirc;u mỏng nhẹ với trọng lượng chỉ khoảng 199g, d&agrave;y khoảng 8.2 mm, cho cảm gi&aacute;c cầm nắm vừa vặn v&agrave; thoải m&aacute;i. Đ&acirc;y ắt hẳn l&agrave; &ldquo;ch&acirc;n &aacute;i&rdquo; đối với c&aacute;c t&iacute;n đồ ưa x&ecirc; dịch, thường xuy&ecirc;n di chuyển n&ecirc;n cần những thiết bị mỏng nhẹ linh hoạt. Điện thoại được thiết kế nguy&ecirc;n khối với viền kim loại &ocirc;m trọn cụm camera một c&aacute;ch tinh tế, tạo n&ecirc;n tổng thể liền mạch trẻ trung nhưng cũng kh&ocirc;ng k&eacute;m phần sang trọng. Samsung A34 5G c&oacute; mặt lưng tr&aacute;ng gương hiện đại v&agrave; kho&aacute;c l&ecirc;n m&igrave;nh những gam m&agrave;u trẻ trung, đầy sức sống bao gồm:&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-samsung-galaxy-a34-5g-8gb-128gb-bac.html\">Bạc Bất Bại</a>,&nbsp;<a href=\"https://nguyenkim.com/dien-thoai-samsung-galaxy-a34-5g-8gb-128gb-xanh.html\">Xanh Dũng M&atilde;nh</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-samsung-galaxy-a34-5g-8gb-128gb-den.html\">Đen Chiến Binh</a>. C&aacute;c tone m&agrave;u nhẹ nh&agrave;ng m&agrave; A34 5G sở hữu cũng ch&iacute;nh l&agrave; xu hướng đương thời - tinh tế, thời thượng, ph&ugrave; hợp với mọi đối tượng bất kể độ tuổi v&agrave; giới t&iacute;nh,&nbsp;khiến ai nấy cũng phải &quot;xi&ecirc;u l&ograve;ng&quot; trước vẻ đẹp của ch&uacute;ng.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung A34 5G mỏng nhẹ sang trọng\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/samsung-galaxy-a34-5g-1.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Bộ 3 camera độ ph&acirc;n giải tới 4