/h3>\r\n\r\n<p>Chi tiết đắt gi&aacute; tiếp theo đ&oacute; l&agrave; Galaxy A54 5G sở hữu th&ocirc;ng số camera v&ocirc; c&ugrave;ng ấn tượng với&nbsp;<a href=\"https://www.nguyenkim.com/cach-chup-anh-selfie-dep.html\">camera selfie</a>&nbsp;độ ph&acirc;n giải l&ecirc;n đến 32MP cho ảnh chụp ch&acirc;n dung đẹp h&uacute;t hồn. Ph&iacute;a sau l&agrave; bộ 3 camera, với camera ch&iacute;nh độ ph&acirc;n giải đến 50MP chụp ảnh r&otilde; n&eacute;t từng chi tiết; 1 camera chụp g&oacute;c si&ecirc;u rộng 12MP v&agrave; cuối c&ugrave;ng l&agrave; 1 camera Macro chụp cận cảnh 5MP. Th&ocirc;ng số camera n&agrave;y đủ để đảm bảo cho người d&ugrave;ng tạo n&ecirc;n những tuyệt t&aacute;c ảnh ho&agrave;n hảo d&ugrave; l&agrave; ch&acirc;n dung, to&agrave;n cảnh hay cận cảnh.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G màn hình lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-galaxy-a54-5g-2.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>M&agrave;n h&igrave;nh Super AMOLED ph&acirc;n giải Full HD+, hiển thị r&otilde; ngay dưới &aacute;nh nắng ch&oacute;i</h3>\r\n\r\n<p>M&agrave;n h&igrave;nh Galaxy A54 5G trang bị tấm nền Super AMOLED&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">độ ph&acirc;n giải Full HD+</a>&nbsp;mang đến trải nghiệm xem đầy m&ecirc; hoặc với h&igrave;nh ảnh được t&aacute;i tạo c&oacute; độ n&eacute;t căng v&agrave; m&agrave;u sắc sống động như thực. Độ s&aacute;ng m&agrave;n h&igrave;nh tối đa&nbsp;đến 1000 nits cho khung h&igrave;nh s&aacute;ng hơn 25% (so với sản phẩm tiền nhiệm&nbsp;<a href=\"https://www.nguyenkim.com/tim-kiem.html?tu-khoa=Samsung+A53+5G\">Samsung A53 5G</a>) gi&uacute;p bạn nh&igrave;n r&otilde; m&agrave;n h&igrave;nh ngay cả dưới &aacute;nh nắng ch&oacute;i chang. Th&ecirc;m v&agrave;o đ&oacute;, tần số l&agrave;m tươi khung h&igrave;nh đến 120Hz cho khả năng hiển thị h&igrave;nh ảnh mượt m&agrave;, linh hoạt. M&agrave;n h&igrave;nh Infinity-O rộng 6.4 inch gi&uacute;p mở rộng tầm nh&igrave;n để mắt bạn được thoải m&aacute;i mỗi khi lướt web, xem phim, chơi game.</p>\r\n\r\n<p><img alt=\"Điện thoại samsung galaxy A54 5G camera chất lượng\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-galaxy-a54-5g-5.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Chống rung quang học OIS, quay chụp ho&agrave;n hảo</strong></h3>\r\n\r\n<p>Với Galaxy A54, d&ugrave; đang di chuyển th&igrave; bạn vẫn ghi lại được những h&igrave;nh ảnh, thước phim đ&aacute;ng nhớ nhờ t&iacute;nh năng VDIS v&agrave; c&ocirc;ng nghệ&nbsp;<a href=\"https://www.nguyenkim.com/nhung-dieu-can-biet-ve-cong-nghe-chong-rung-quang-hoc.html\">Chống Rung Quang Học</a>&nbsp;OIS gi&uacute;p ổn định những khung h&igrave;nh, giữ cho chuyển động lu&ocirc;n mượt m&agrave;, r&otilde; n&eacute;t, kh&ocirc;ng mờ nh&ograve;e ngay cả khi trong điều kiện rung lắc v&agrave; thiếu s&aacute;ng.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G chống rung tốt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-a54-5g-4.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G hiệu năng mạnh mẽ\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-a54-5g-6.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Hiệu năng mạnh mẽ, đa nhiệm đỉnh cao</strong></h3>\r\n\r\n<p>Nhờ trang bị chip Exynos 1380 c&ugrave;ng dung lượng RAM 8GB, Galaxy A54 5G cho hiệu năng mạnh mẽ, xử l&yacute; mượt m&agrave; d&ugrave; mở c&ugrave;ng l&uacute;c nhiều ứng dụng. Với hiệu năng n&agrave;y, thiết bị cũng cho khả năng xem phim, lướt web,&nbsp;<a href=\"https://www.nguyenkim.com/game-kiem-tien-online.html\">chơi game</a>&nbsp;cực kỳ ổn định.</p>\r\n\r\n<h3><strong>Kết nối 5G thần tốc, n&acirc;ng tầm trải nghiệm giải tr&iacute;</strong></h3>\r\n\r\n<p>Chiếc&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-di-dong/\">điện thoại</a>&nbsp;n&agrave;y mở ra kỷ nguy&ecirc;n trải nghiệm mạng di động mới với tốc độ vượt trội nhờ hỗ trợ kết nối 5G ti&ecirc;n tiến, để người d&ugrave;ng chơi game, ph&aacute;t trực tuyến mượt m&agrave;, chia sẻ v&agrave; tải xuống mọi dữ liệu nhanh thần tốc.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G hỗ trợ 5G\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-galaxy-a54-5g-6.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G dung lượng pin lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-galaxy-a54-5g-8.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Pin 5.000mAh bền bỉ, k&eacute;o d&agrave;i tối đa đến 2 ng&agrave;y</strong></h3>\r\n\r\n<p>Sở hữu vi&ecirc;n pin dung lượng lớn 5.000mAh (ti&ecirc;u chuẩn), Samsung A54 5G cho thời lượng sử dụng k&eacute;o d&agrave;i tối đa đến 2 ng&agrave;y để bạn tha hồ xem phim, lướt web, chơi game... Việc sạc đầy pin 100% cũng v&ocirc; c&ugrave;ng nhanh ch&oacute;ng với c&ocirc;ng nghệ Sạc si&ecirc;u nhanh đến 25W.</p>\r\n\r\n<h3><strong>Chuẩn kh&aacute;ng bụi, kh&aacute;ng nước IP67</strong></h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/dien-thoai-di-dong-samsung/\">Điện thoại Samsung</a>&nbsp;Galaxy A54 5G đạt ti&ecirc;u chuẩn IP67 cho khả năng chống nước v&agrave; chống bụi, tức vẫn hoạt động b&igrave;nh thường d&ugrave; ở dưới nước c&oacute; độ s&acirc;u 1 m&eacute;t trong tối đa 30 ph&uacute;t. Ngo&agrave;i ra, với trang bị mặt lưng k&iacute;nh, thiết bị của bạn giờ đ&acirc;y cứng c&aacute;p hơn v&agrave; &iacute;t bị trầy xước hơn.</p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G kháng nước\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-galaxy-a54-5g-9.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Samsung Galaxy A54 5G mở khóa vân tay\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/Content/dien-thoai/SamSung/dien-thoai-samsung-galaxy-a54-5g-12.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Cảm biến v&acirc;n tay, mở kh&oacute;a 1 chạm tức th&igrave;</strong></h3>\r\n\r\n<p>Với cảm biến v&acirc;n tay t&iacute;ch hợp tr&ecirc;n m&agrave;n h&igrave;nh, bạn c&oacute; thể mở m&aacute;y ngay tức th&igrave; chỉ với 1 chạm ng&oacute;n tay để đăng nhập v&agrave; sử dụng ngay. Ch&uacute;ng kh&ocirc;ng những gi&uacute;p mở kh&oacute;a nhanh, ch&iacute;nh x&aacute;c m&agrave; c&ograve;n tăng cường bảo mật v&igrave; bạn kh&ocirc;ng c&ograve;n phải sợ ai đ&oacute; nh&ograve;m ng&oacute; v&agrave; biết được mật khẩu bằng những c&aacute;ch mở th&ocirc;ng thường.</p>', 10490000, 'f300a71e99b1bcd20249b7c841763ce9.jpg', 100, 1500000, 'dien-thoai-samsung-galaxy-a54-5g-8gb128gb-xanh', 'active', 0, 'Xanh', 'Super AMOLED, 1000 nits, Eye-care giảm tới 50% ánh sáng xanh', 'Android 13, One UI 5', 'Exynos 1380 8 nhân', 'FHD+ pixels', '32MP F2.2', '50 MP F1.8 OIS (Rộng); 12 MP F2.2 (Siêu Rộng); 5 MP F2.4 (Cận cảnh)', '8 GB', '128 GB', 'Nano SIM', '5000 mAh', 0, '2023-04-27 16:30:05', '2023-04-27 16:30:05');
INSERT INTO `products` (`id`, `code`, `category_id`, `name`, `description`, `price`, `featured_image`, `quantity`, `discount`, `slug`, `status`, `featured`, `color`, `screen_technology`, `os`, `cpu`, `resolution`, `front_camera`, `rear_camera`, `ram`, `rom`, `sim`, `pin`, `view_count`, `created_at`, `updated_at`) VALUES
(45, 'VT235202', 16, 'Điện thoại OPPO A17K 3GB/64GB Vàng', '<p>OPPO d&ograve;ng A Series lu&ocirc;n được l&ograve;ng người d&ugrave;ng tr&ecirc;n thị trường điện thoại th&ocirc;ng minh bởi cấu h&igrave;nh ổn đi k&egrave;m gi&aacute; b&aacute;n hấp dẫn. Trong số đ&oacute;, t&acirc;n binh OPPO A17K với thiết kế hiện đại, được n&acirc;ng cấp về dung lượng pin v&agrave; camera so với thế hệ tiền nhiệm l&agrave; sản phẩm hứa hẹn được đ&ocirc;ng đảo fan OPPO y&ecirc;u th&iacute;ch.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/11.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Thiết kế hiện đại, m&agrave;u sắc trẻ trung</strong></p>\r\n\r\n<p>Tuy thuộc ph&acirc;n kh&uacute;c gi&aacute; rẻ nhưng OPPO vẫn rất chỉn chu trong việc chế t&aacute;c sản phẩm d&ograve;ng A Series. Minh chứng l&agrave; OPPO A17k được ho&agrave;n thiện với phần khung viền nhựa vu&ocirc;ng vức cực hiện đại m&agrave; kh&ocirc;ng k&eacute;m phần sang trọng. Trọng lượng m&aacute;y si&ecirc;u mỏng nhẹ, chỉ 8.29mm v&agrave; 189gram tạo cảm gi&aacute;c cầm nắm thoải m&aacute;i, dễ d&agrave;ng. Bạn c&oacute; thể mang theo b&ecirc;n m&igrave;nh đi bất cứ nơi đ&acirc;u m&agrave; kh&ocirc;ng sợ bị nặng hay chiếm qu&aacute; nhiều diện t&iacute;ch t&uacute;i quần, t&uacute;i x&aacute;ch.</p>\r\n\r\n<p>OPPO A17k c&oacute; 2 m&agrave;u sắc gồm v&agrave;ng v&agrave; xanh dương, vừa tinh tế v&agrave; v&ocirc; c&ugrave;ng trẻ trung lại ph&ugrave; hợp với mọi giới t&iacute;nh hay độ tuổi.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/22.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Điện thoại c&ograve;n được t&iacute;ch hợp sẵn mở kh&oacute;a v&acirc;n tay si&ecirc;u nhạy ngay n&uacute;t nguồn ở cạnh b&ecirc;n v&ocirc; c&ugrave;ng thuận tiện. So với thế hệ tiền nhiệm đặt cảm biến ở mặt lưng, sự thay đổi n&agrave;y kh&ocirc;ng chỉ mang t&iacute;nh thẩm mỹ cao hơn cho OPPO A17k m&agrave; c&ograve;n gi&uacute;p n&oacute; c&oacute; độ an to&agrave;n, bảo mật cao hơn. Giờ đ&acirc;y, mỗi khi muốn mở kh&oacute;a, bạn chỉ cần một thao t&aacute;c chạm nhẹ chưa tới 3 gi&acirc;y l&agrave; đ&atilde; c&oacute; thể sử dụng.</p>\r\n\r\n<p><strong>M&agrave;n h&igrave;nh lớn 6.56 inch cho trải nghiệm tuyệt vời</strong></p>\r\n\r\n<p>OPPO trang bị cho m&aacute;y m&agrave;n h&igrave;nh IPS LCD k&iacute;ch thước 6.56 inch, hỗ trợ độ ph&acirc;n giải HD+ (720 x 1612 pixels) độ s&aacute;ng 600 nits v&agrave; mật độ điểm ảnh khoảng 269 PPI. Nhờ vậy, điện thoại OPPO A17K sở hữu khả năng hiển thị chuẩn 100% gam m&agrave;u DCI-P3 c&ugrave;ng khả năng l&agrave;m mờ th&ocirc;ng minh, gi&uacute;p m&agrave;u sắc ch&acirc;n thực, mượt m&agrave; v&agrave; th&acirc;n thiện với mắt.</p>\r\n\r\n<p><strong>Camera AI chụp ảnh sắc n&eacute;t v&agrave; x&oacute;a ph&ocirc;ng ấn tượng</strong></p>\r\n\r\n<p>OPPO A17k được trang bị camera dạng h&igrave;nh vi&ecirc;n thuốc, c&oacute; độ ph&acirc;n giải 8MP si&ecirc;u r&otilde; n&eacute;t, được v&aacute;t phẳng giống&nbsp; thiết kế mặt lưng m&aacute;y. B&ecirc;n dưới l&agrave; đ&egrave;n flash LED. Ngo&agrave;i ra thiết bị c&ograve;n một m&aacute;y ảnh selfie 5 MP ở mặt trước.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/33.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>D&ugrave; thuộc d&ograve;ng A Series nhưng OPPO vẫn ưu &aacute;i trang bị nhiều t&iacute;nh năng phần mềm n&acirc;ng cao để sản phẩm cho ra những bức h&igrave;nh chất lượng hơn. Điển h&igrave;nh như chế độ l&agrave;m đẹp ch&acirc;n dung AI với c&aacute;c thuật to&aacute;n th&ocirc;ng minh sẽ điều chỉnh mọi thứ thật tự nhi&ecirc;n dựa theo m&agrave;u sắc v&agrave; tone da của bạn, đảm bảo độ chi tiết ho&agrave;n hảo khi chụp ch&acirc;n dung v&agrave; phong cảnh.</p>\r\n\r\n<p><strong>Chip Helio G35 ổn định, bộ nhớ lớn lưu trữ thoải m&aacute;i</strong></p>\r\n\r\n<p>OPPO A17k được cung cấp sức mạnh bởi vi xử l&yacute; Helio G35. Đ&acirc;y l&agrave; con chip sản xuất tr&ecirc;n tiến tr&igrave;nh 12nm, 8 nh&acirc;n Cortex-A53 tốc độ 2.3GHz, t&iacute;ch hợp c&ocirc;ng nghệ HyperEngine đen đến hiệu năng ổn định đối với c&aacute;c t&aacute;c vụ đơn giản hoặc chơi game nhẹ nh&agrave;ng.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/44.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dung lượng bộ nhớ lưu trữ l&ecirc;n đến 64GB, để người d&ugrave;ng lưu trữ thoải m&aacute;i h&igrave;nh ảnh, tệp v&agrave; dữ liệu. Đ&aacute;ng ch&uacute; &yacute;, đa nhiệm tr&ecirc;n OPPO A17k sẽ mượt m&agrave; hơn với c&ocirc;ng nghệ mở rộng RAM. Cụ thể, m&aacute;y c&oacute; ROM 3GB nhưng thực tế c&oacute; thể rộng th&ecirc;m được đến 4GB RAM, n&acirc;ng tổng RAM m&aacute;y l&ecirc;n tới 7GB.</p>\r\n\r\n<p>Về phần mềm, thiết bị chạy tr&ecirc;n hệ điều h&agrave;nh Android 12 với giao diện người d&ugrave;ng ColorOS 12 rất dễ sử dụng.</p>\r\n\r\n<p><strong>Vi&ecirc;n pin lớn 5.000mAh thoải m&aacute;i sử dụng</strong></p>\r\n\r\n<p>OPPO A17k c&oacute; dung lượng pin lớn 5.000mAh, cải thiện hơn so với thế hệ tiền nhiệm. Đ&acirc;y l&agrave; mức pin ti&ecirc;u chuẩn đủ d&ugrave;ng cho c&aacute;c smartphone hiện nay. Kết hợp c&ugrave;ng vi xử l&yacute; tiết kiệm điện năng gi&uacute;p điện thoại hoạt động bền bỉ cả ng&agrave;y d&agrave;i với c&aacute;c t&aacute;c vụ cơ bản. Ngay cả khi bạn ở ngo&agrave;i cả ng&agrave;y d&agrave;i cũng kh&ocirc;ng qu&aacute; lo lắng việc m&aacute;y bị hết pin giữa chừng.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/55.jpg\" /></p>', 3290000, 'cb9efe0e376aac38f5dbb39c86f14437.jpg', 96, 300000, 'dien-thoai-oppo-a17k-3gb64gb-vang', 'active', 1, 'Vàng', 'LCD, Kính cường lực Panda', 'ColorOS 12.1.1, nền tảng Android 12', 'Helio G35, tối đa 2.3GHz', 'HD+ (720 x 1612) pixels', '5 MP', '8 MP', '3 GB', '64 GB', '2 nano SIM', '5000 mAh, sạc 10W', 173, '2023-04-27 16:52:02', '2023-05-14 08:34:45'),
(46, 'VH000331', 16, 'Điện thoại OPPO A17K 3GB/64GB Xanh', '<p>OPPO d&ograve;ng A Series lu&ocirc;n được l&ograve;ng người d&ugrave;ng tr&ecirc;n thị trường điện thoại th&ocirc;ng minh bởi cấu h&igrave;nh ổn đi k&egrave;m gi&aacute; b&aacute;n hấp dẫn. Trong số đ&oacute;, t&acirc;n binh OPPO A17K với thiết kế hiện đại, được n&acirc;ng cấp về dung lượng pin v&agrave; camera so với thế hệ tiền nhiệm l&agrave; sản phẩm hứa hẹn được đ&ocirc;ng đảo fan OPPO y&ecirc;u th&iacute;ch.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/11.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Thiết kế hiện đại, m&agrave;u sắc trẻ trung</strong></p>\r\n\r\n<p>Tuy thuộc ph&acirc;n kh&uacute;c gi&aacute; rẻ nhưng OPPO vẫn rất chỉn chu trong việc chế t&aacute;c sản phẩm d&ograve;ng A Series. Minh chứng l&agrave; OPPO A17k được ho&agrave;n thiện với phần khung viền nhựa vu&ocirc;ng vức cực hiện đại m&agrave; kh&ocirc;ng k&eacute;m phần sang trọng. Trọng lượng m&aacute;y si&ecirc;u mỏng nhẹ, chỉ 8.29mm v&agrave; 189gram tạo cảm gi&aacute;c cầm nắm thoải m&aacute;i, dễ d&agrave;ng. Bạn c&oacute; thể mang theo b&ecirc;n m&igrave;nh đi bất cứ nơi đ&acirc;u m&agrave; kh&ocirc;ng sợ bị nặng hay chiếm qu&aacute; nhiều diện t&iacute;ch t&uacute;i quần, t&uacute;i x&aacute;ch.</p>\r\n\r\n<p>OPPO A17k c&oacute; 2 m&agrave;u sắc gồm v&agrave;ng v&agrave; xanh dương, vừa tinh tế v&agrave; v&ocirc; c&ugrave;ng trẻ trung lại ph&ugrave; hợp với mọi giới t&iacute;nh hay độ tuổi.</p>\r\n\r\n<p><img src=\"https://cdn.hoanghamobile.com/i/content/Uploads/2022/11/08/22.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Điện thoại c&ograve;n được t&iacute;ch hợp sẵn mở kh&oacute;a v&acirc;n tay si&ecirc;u nhạy ngay n&uacute;t nguồn ở cạnh b&ecirc;n v&ocirc; c&ugrave;ng thuận tiện. So với thế hệ tiền nhiệm đặt cảm biến ở mặt lưng, sự thay đổi n&agrave;y kh&ocirc;ng chỉ mang t&iacute;nh thẩm mỹ cao hơn cho OPPO A17k m&agrave; c&ograve;n gi&uacute;p n&oacute; c&