ghi lại&nbsp;c&aacute;c h&igrave;nh ảnh c&oacute; chi tiết cực nhỏ ở khoảng c&aacute;ch thật gần v&agrave;&nbsp;kh&aacute;m ph&aacute; thế giới kỳ th&uacute; th&ocirc;ng qua những vật thể nhỏ b&eacute; xung quanh m&igrave;nh. Ph&iacute;a trước l&agrave; camera selfie 8MP gi&uacute;p bạn tự tay tạo những bức ảnh ch&acirc;n dung đẹp tự nhi&ecirc;n v&agrave; r&otilde; n&eacute;t. Hệ thống camera sau c&ograve;n hỗ trợ một loạt c&aacute;c t&iacute;nh năng cao cấp gồm:&nbsp;Chụp đ&ecirc;m, Ch&acirc;n dung, Độ ph&acirc;n giải cao, Chụp to&agrave;n cảnh, Live Photo, Quay chuyển động chậm, Quay tua nhanh thời gian, Chế độ chuy&ecirc;n nghiệp, DOC... V&igrave; vậy, người d&ugrave;ng sẽ được trải nghiệm c&aacute;c t&iacute;nh năng chụp ảnh cao cấp tương tự&nbsp;<a href=\"https://www.nguyenkim.com/nguyenkim.com/nhu-the-nao-la-mot-san-pham-flagship-ban-da-biet.html\">c&aacute;c d&ograve;ng điện thoại Flagship</a>&nbsp;ngay tr&ecirc;n chiếc điện thoại gi&aacute; b&igrave;nh d&acirc;n n&agrave;y.</p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s camera kép tích hợp AI\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-3.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh lớn HD+, hạn chế &aacute;nh s&aacute;ng xanh</strong></h3>\r\n\r\n<p>Y22s trang bị m&agrave;n h&igrave;nh lớn 6.55&quot;,&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">độ ph&acirc;n giải HD+</a>&nbsp;cho trải nghiệm h&igrave;nh ảnh sắc n&eacute;t, m&agrave;u sắc sống động. Ngo&agrave;i ra, m&aacute;y c&ograve;n c&oacute; Chế độ Bảo Vệ Mắt gi&uacute;p giảm &aacute;nh s&aacute;ng xanh, bảo vệ thị lực của bạn v&agrave; mang lại cảm gi&aacute;c thoải m&aacute;i nhất cho mắt.</p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s màn hình lớn thiết kế tràn viền\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-5.png\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s vi xử lý mạnh mẽ, lướt chạm mượt mà\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-7.png\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Chip Qualcomm Snapdragon 680, hiệu suất ấn tượng</strong></h3>\r\n\r\n<p>Được vận h&agrave;nh bởi bộ vi xử l&yacute; Qualcomm Snapdragon 680 sản xuất tr&ecirc;n tiến tr&igrave;nh 6nm, Vivo Y22s gi&uacute;p xử l&yacute; mượt m&agrave; mọi t&aacute;c vụ từ nghe gọi, lướt web, xem phim, hay thậm ch&iacute;&nbsp;<a href=\"https://nguyenkim.com/top-5-dien-thoai-choi-game-muot-ma-nhat-2022.html\">chơi c&aacute;c tựa game nặng</a>&nbsp;một c&aacute;ch ổn định, kh&ocirc;ng bị giật, lag, đơ m&aacute;y l&agrave;m gi&aacute;n đoạn cuộc vui của bạn.</p>\r\n\r\n<h3><strong>Đa nhiệm tốt, kh&ocirc;ng gian lưu trữ lớn</strong></h3>\r\n\r\n<p>X&eacute;t trong tầm gi&aacute;, th&igrave; Vivo Y22s sở hữu&nbsp;<a href=\"https://nguyenkim.com/ram-la-bo-nho-trong-hay-ngoai.html\">dung lượng RAM v&agrave; ROM</a>&nbsp;dẫn đầu cực kỳ ấn tượng v&agrave; dẫn đầu ph&acirc;n kh&uacute;c. Cụ thể, RAM lớn tới 8GB đa nhiệm cực tốt, cho ph&eacute;p bạn mở nhiều tag c&ugrave;ng l&uacute;c m&agrave; m&aacute;y vẫn chạy mượt. C&ugrave;ng bộ nhớ trong 128GB mở ra kh&ocirc;ng gian rộng lớn để&nbsp;bạn tha hồ lưu trữ bất cứ h&igrave;nh ảnh, video hay dữ liệu n&agrave;o m&igrave;nh y&ecirc;u th&iacute;ch.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s không gian lưu trữ lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-8.png\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s chơi game tốt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-10.png\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Multi-Turbo 5.0, chiến game cực &quot;đỉnh&quot;&nbsp;</strong></h3>\r\n\r\n<p>Trải nghiệm chơi game cực đ&atilde;&nbsp;với c&ocirc;ng nghệ Multi-Turbo 5.0 n&acirc;ng cao khả năng kết nối dữ liệu, tốc độ bộ xử l&yacute; hệ thống v&agrave; tối ưu mức ti&ecirc;u thụ năng lượng gi&uacute;p m&aacute;y hoạt động ổn định trong suốt qu&aacute; tr&igrave;nh chơi game để bạn chiếm ưu thế nhanh nhạy hơn so với đối thủ v&agrave; tăng cơ hội gi&agrave;nh chiến thắng.</p>\r\n\r\n<h3>Pin lớn 5000mAh, d&ugrave;ng bền bỉ cả ng&agrave;y</h3>\r\n\r\n<p>Y22s với dung lượng pin 5000mAh, c&ugrave;ng c&ocirc;ng nghệ AI hỗ trợ tiết kiệm năng lượng sẽ gi&uacute;p bạn k&eacute;o d&agrave;i thời gian sử dụng suốt cả ng&agrave;y d&agrave;i chỉ với 1 lần sạc. C&ocirc;ng nghệ Sạc Si&ecirc;u Tốc 18W gi&uacute;p nạp đầy năng lượng nhanh ch&oacute;ng. M&aacute;y c&ograve;n c&oacute; t&iacute;nh năng sạc ngược để bạn tiếp sức cho c&aacute;c thiết bị kh&aacute;c dễ d&agrave;ng.</p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s dung lượng pin lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-11.png\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Vivo Y22s mở khóa vân tay, mở khóa khuôn mặt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/VIVO/Vivo%20Y22s/dien-thoai-vivo-y22s-13.png\" style=\"width:100%\" /></p>\r\n\r\n<h3>Mở kh&oacute;a v&acirc;n tay cạnh b&ecirc;n+ mở kh&oacute;a bằng khu&ocirc;n mặt</h3>\r\n\r\n<p>M&aacute;y cho khả năng&nbsp;<a href=\"https://www.nguyenkim.com/iphone-bi-vo-hieu-hoa.html\">mở kh&oacute;a cực nhanh</a>&nbsp;v&agrave; cực kỳ an to&agrave;n. Thiết kế Cảm Biến V&acirc;n Tay t&iacute;ch hợp ngay tr&ecirc;n n&uacute;t nguồn&nbsp; gi&uacute;p bạn bật m&agrave;n h&igrave;nh v&agrave; mở kh&oacute;a điện thoại của m&igrave;nh c&ugrave;ng một l&uacute;c. Hoặc bạn cũng c&oacute; thể sử dụng t&iacute;nh năng Mở Kho&aacute; Bằng Khu&ocirc;n Mặt để mở kh&oacute;a điện thoại bất cứ khi n&agrave;o cần chỉ trong nh&aacute;y mắt.</p>', 5990000, '9d532d50ef4733070a38dfca3bbdeb4d.jpg', 98, 1000000, 'dien-thoai-vivo-y22s-8gb128gb-xanh-vang', 'active', 1, 'Xanh vàng', 'IPS LCD', 'Android 12 (Funtouch OS 12)', 'Qualcomm Snapdragon 680', 'HD+ (720 x 1612) pixels', '8 MP ( f/2.0)', '50 MP ( f/1.8) + 2 MP ( f/2.4)', '8 GB', '128 GB', '2 sim 2 sóng (DSDS)', '5000mAh (TYP)', 3, '2023-05-07 05:48:10', '2023-05-14 06:02:44'),
(64, 'TV125515', 18, 'Điện thoại Xiaomi Redmi Note 11 Pro 5G 8GB/128GB Trắng', '<h3><strong>Thiết kế hết mực sang trọng, m&agrave;u sắc đẹp cuốn h&uacute;t&nbsp;</strong></h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/dien-thoai-xiaomi-redmi-note11pro-5g-8gb-128gb-xam.html\"><strong>Điện thoại Xiaomi Redmi Note 11 Pro 5G Trắng</strong></a>&nbsp;thiết kế kh&aacute; mỏng nhẹ với trọng lượng chỉ khoảng 202 gam, d&agrave;y 8.12 mm cho cảm gi&aacute;c cầm nắm thoải m&aacute;i. Đ&acirc;y ắt hẳn l&agrave; &ldquo;ch&acirc;n &aacute;i&rdquo; đối với những ai thường xuy&ecirc;n di chuyển, cần những thiết bị mỏng nhẹ linh hoạt. Điện thoại sở hữu thiết kế nguy&ecirc;n khối, c&aacute;c camera đặt chung trong 1 m&ocirc; đun bo tr&ograve;n tinh tế, sắc Trắng Gradient lạ mắt tạo n&ecirc;n tổng thể sang trọng, thanh lịch v&agrave; th&iacute;ch hợp với mọi giới t&iacute;nh v&agrave; độ tuổi.</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G màu Xám độc đáo\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-trang-h1.png\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Hiệu năng ổn định, kết nối 5G thần tốc, &ldquo;chiến&rdquo; tốt c&aacute;c tựa game</strong></h3>\r\n\r\n<p>Kh&ocirc;ng chỉ đẹp về mẫu m&atilde;,&nbsp;<a href=\"https://www.nguyenkim.com/tim-kiem.html?tu-khoa=%C4%91i%E1%BB%87n+tho%E1%BA%A1i+Xiaomi+Redmi\">điện thoại Redmi</a>&nbsp;Note 11 Pro 5G c&ograve;n sở hữu hiệu năng mạnh mẽ vượt trội để bạn &ldquo;chiến&rdquo; c&aacute;c con game, xem phim, nghe nhạc, lướt web mượt m&agrave; với c&aacute;c trang bị cao cấp như: bộ vi xử l&yacute; Snapdragon 695 5G 8 nh&acirc;n, kết nối 5G si&ecirc;u tốc, tần số qu&eacute;t m&agrave;n h&igrave;nh 120Hz, RAM 8GB c&ugrave;ng ROM lớn 128GB gi&uacute;p đa nhiệm mượt m&agrave; v&agrave; tha hồ lưu trữ dữ liệu, pin 5000mAh bền bỉ c&ugrave;ng khả năng sạc pin nhanh ch&oacute;ng với Si&ecirc;u sạc nhanh 67W.</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G chơi game tốt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-trang-h2.png\" style=\"width:100%\" /></p>\r\n\r\n<h3>Camera ch&iacute;nh 108MP, tự do s&aacute;ng tạo những tuyệt t&aacute;c ảnh đẹp chuy&ecirc;n nghiệp</h3>\r\n\r\n<p><strong>Chi tiết đắt gi&aacute; tiếp theo khiến c&aacute;c t&iacute;n đồ y&ecirc;u c&ocirc;ng nghệ đặc biệt l&agrave; những người đam m&ecirc; chụp ảnh kh&oacute; c&oacute; thể bỏ qua đ&oacute; ch&iacute;nh l&agrave; Redmi Note 11 Pro 5G c&oacute; cụm 3 camera sau chất lượng. Trong đ&oacute;, camera ch&iacute;nh c&oacute; độ ph&acirc;n giải l&ecirc;n đến 108MP gi&uacute;p chụp ảnh với độ chi tiết cao, thậm ch&iacute; ngay cả khi zoom vật thể ở xa. Camera g&oacute;c si&ecirc;u rộng 8MP gi&uacute;p bắt trọn to&agrave;n cảnh vật, khung cảnh thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ. Cuối c&ugrave;ng l&agrave; camera Macro 2MP hỗ trợ chụp cận cảnh. Ph&iacute;a trước&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-di-dong/\">điện thoại</a>&nbsp;l&agrave; camera Selfie được đặt ngay ngắn trong phần đục lỗ với độ ph&acirc;n giải 16MP để bạn s&aacute;ng tạo những bức ảnh ch&acirc;n dung đẹp tự nhi&ecirc;n, r&otilde; n&eacute;t.</strong></p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G chụp hình sắc nét\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-trang-h3.png\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh tr&agrave;n viền 6.67&quot;, ph&acirc;n giải Full HD+</strong></h3>\r\n\r\n<p>Xiaomi Redmi Note 11 Pro 5G sở hữu m&agrave;n h&igrave;nh lớn 6.67&quot;,&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">độ ph&acirc;n giải Full HD+</a>&nbsp;c&ugrave;ng thiết kế tr&agrave;n viền - mở ra kh&ocirc;ng gian rộng lớn để người d&ugrave;ng xem phim, lướt web, chơi game với hiển thị h&igrave;nh ảnh đẹp mắt. Độ s&aacute;ng m&agrave;n h&igrave;nh tối đa 1200 nits gi&uacute;p bạn c&oacute; thể xem tốt ngo&agrave;i trời nắng ch&oacute;i. M&aacute;y hỗ trợ t&iacute;nh năng hạn chế &aacute;nh s&aacute;ng xanh để hạn chế t&aacute;c hại đến mắt trong qu&aacute; tr&igrave;nh sử dụng.</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G màn hình lớn 6.67 inch\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-xam-h4.png\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G giá rẻ lướt chạm mượt mà\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h5.png\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Tốc độ l&agrave;m tươi m&agrave;n h&igrave;nh 120Hz</strong></h3>\r\n\r\n<p>Xiaomi Redmi Note 11 Pro 5g c&oacute; tần số qu&eacute;t m&agrave;n h&igrave;nh l&ecirc;n đến 120Hz. C&oacute; thể n&oacute;i đ&acirc;y l&agrave; th&ocirc;ng số tần số qu&eacute;t dẫn đầu trong tầm gi&aacute;, mang đến tốc độ l&agrave;m mới cao hơn để khung h&igrave;nh &ecirc;m mượt v&agrave; nhanh hơn.</p>\r\n\r\n<h3><strong>Chip Snapdragon 695 5G hiệu năng ổn định</strong></h3>\r\n\r\n<p>Nhờ trang bị chip Qualcomm Snapdragon 695, m&aacute;y cho khả năng xử l&yacute; mượt m&agrave; từ c&aacute;c t&aacute;c vụ nghe, gọi, lướt web thường ng&agrave;y cho đến chơi c&aacute;c con game ổn định, kh&ocirc;ng bị giật lag để gi&agrave;nh ưu thế so với đối thủ trong c&aacute;c v&aacute;n&nbsp;<a href=\"https://www.nguyenkim.com/game-kiem-tien-online.html\">game</a>&nbsp;nhờ sự nhanh nhạy.</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G vi xử lý Snapdragon\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h7.png\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G có kết nối 5G\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-trang-h7%20(1).png\" style=\"width:100%\" /></p>\r\n\r\n<h3>Kết nối 5G, n&acirc;ng tầm trải nghiệm giải tr&iacute;&nbsp;</h3>\r\n\r\n<p>Nhờ hỗ trợ kết nối 5G ti&ecirc;n tiến, Xiaomi Redmi Note 11 Pro 5G mở ra kỷ nguy&ecirc;n trải nghiệm mạng di động mới với tốc độ nhanh vượt trội để người d&ugrave;ng chơi game, ph&aacute;t trực tuyến mượt m&agrave;, chia sẻ v&agrave; tải xuống mọi dữ liệu thần tốc.</p>\r\n\r\n<h3><strong>C&ocirc;ng nghệ LiquidCool tản nhiệt nhanh&nbsp;</strong></h3>\r\n\r\n<p>Nh&agrave; Xiaomi ưu &aacute;i t&iacute;ch hợp cho c&ocirc;ng nghệ LiquidCool l&agrave;m m&aacute;t bằng lớp Graphite v&agrave; ống dẫn nhiệt để m&aacute;y nhanh ch&oacute;ng tản nhiệt ra b&ecirc;n ngo&agrave;i, kh&ocirc;ng n&oacute;ng qu&aacute; mức khi sử dụng ở tần suất cao.</p>\r\n\r\n<p><img alt=\" Điện thoại Xiaomi Redmi Note 11 Pro 5G tản nhiệt nhanh\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h9.png\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G dung lượng pin lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-trang-h6.png\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Dung lượng pin 5000mAh k&eacute;o d&agrave;i bền bỉ</strong></h3>\r\n\r\n<p>Sở hữu vi&ecirc;n pin dung lượng lớn 5.000mAh (ti&ecirc;u chuẩn),&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-xiaomi/\">điện thoại Xiaomi</a>&nbsp;Redmi Note 11 Pro cho thời lượng sử dụng k&eacute;o d&agrave;i để bạn tha hồ xem phim, lướt web, chơi game hay l&agrave;m bất cứ g&igrave; m&agrave; kh&ocirc;ng lo sợ hết pin giữa chừng.&nbsp;</p>\r\n\r\n<h3><strong>C&ocirc;ng nghệ sạc si&ecirc;u nhanh 67W</strong></h3>\r\n\r\n<p>Việc sạc đầy pin 100% cũng v&ocirc; c&ugrave;ng nhanh ch&oacute;ng với c&ocirc;ng nghệ Sạc si&ecirc;u nhanh đến 67W t&iacute;ch hợp k&egrave;m gi&uacute;p bạn kh&ocirc;ng bỏ lỡ bất cứ ph&uacute;t gi&acirc;y giải tr&iacute; n&agrave;o. Theo Xiaomi c&ocirc;ng bố, m&aacute;y c&oa