(66, 'MK130228', 18, 'Điện thoại Xiaomi Redmi Note 11 Pro 5G 8GB/128GB Xanh Dương', '<h3><strong>Thiết kế hết mực sang trọng, m&agrave;u sắc đẹp cuốn h&uacute;t&nbsp;</strong></h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/dien-thoai-xiaomi-redmi-note11pro-5g-8gb-128gb-xanh-duong.html\"><strong>Điện thoại Xiaomi Redmi Note 11 Pro 5G Xanh Dương</strong></a>&nbsp;thiết kế kh&aacute; mỏng nhẹ với trọng lượng chỉ khoảng 202 gam, d&agrave;y 8.12 mm cho cảm gi&aacute;c cầm nắm thoải m&aacute;i. Đ&acirc;y ắt hẳn l&agrave; &ldquo;ch&acirc;n &aacute;i&rdquo; đối với những ai thường xuy&ecirc;n di chuyển, cần những thiết bị mỏng nhẹ linh hoạt. Điện thoại sở hữu thiết kế nguy&ecirc;n khối, c&aacute;c camera đặt chung trong 1 m&ocirc; đun bo tr&ograve;n tinh tế, sắc Xanh dương Gradient c&ugrave;ng họa tiết s&oacute;ng nước trắng tạo cảm gi&aacute;c như thể bạn đang nắm giữ cả &ldquo;đại dương&rdquo; rộng lớn tr&ecirc;n tay m&igrave;nh, v&ocirc; c&ugrave;ng độc đ&aacute;o v&agrave; cuốn h&uacute;t.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G màu Xanh dương độc đáo\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h1%20(1).jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>Hiệu năng ổn định, kết nối 5G thần tốc, &ldquo;chiến&rdquo; tốt c&aacute;c tựa game</strong></h3>\r\n\r\n<p>Kh&ocirc;ng chỉ đẹp về mẫu m&atilde;,&nbsp;<a href=\"https://www.nguyenkim.com/tim-kiem.html?tu-khoa=%C4%91i%E1%BB%87n+tho%E1%BA%A1i+Xiaomi+Redmi\">điện thoại Redmi</a>&nbsp;Note 11 Pro 5G c&ograve;n sở hữu hiệu năng mạnh mẽ vượt trội để bạn &ldquo;chiến&rdquo; c&aacute;c con game, xem phim, nghe nhạc, lướt web mượt m&agrave; với c&aacute;c trang bị cao cấp như: bộ vi xử l&yacute; Snapdragon 695 5G 8 nh&acirc;n, kết nối 5G si&ecirc;u tốc, tần số qu&eacute;t m&agrave;n h&igrave;nh 120Hz, RAM 8GB c&ugrave;ng ROM lớn 128GB gi&uacute;p đa nhiệm mượt m&agrave; v&agrave; tha hồ lưu trữ dữ liệu, pin 5000mAh bền bỉ c&ugrave;ng khả năng sạc pin nhanh ch&oacute;ng với Si&ecirc;u sạc nhanh 67W.</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G chơi game tốt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h2.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Camera ch&iacute;nh 108MP, tự do s&aacute;ng tạo những tuyệt t&aacute;c ảnh đẹp chuy&ecirc;n nghiệp</h3>\r\n\r\n<p><strong>Chi tiết đắt gi&aacute; tiếp theo khiến c&aacute;c t&iacute;n đồ y&ecirc;u c&ocirc;ng nghệ đặc biệt l&agrave; những người đam m&ecirc; chụp ảnh kh&oacute; c&oacute; thể bỏ qua đ&oacute; ch&iacute;nh l&agrave; Redmi Note 11 Pro 5G c&oacute; cụm 3 camera sau chất lượng. Trong đ&oacute;, camera ch&iacute;nh c&oacute; độ ph&acirc;n giải l&ecirc;n đến 108MP, gi&uacute;p chụp ảnh với độ chi tiết cao, thậm ch&iacute; ngay cả khi zoom vật thể ở xa. Camera gốc si&ecirc;u rộng 8MP gi&uacute;p bắt trọn to&agrave;n cảnh vật, khung cảnh thi&ecirc;n nhi&ecirc;n h&ugrave;ng vĩ. Cuối c&ugrave;ng l&agrave; camera Macro 2MP hỗ trợ chụp cận cảnh. Ph&iacute;a trước&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-di-dong/\">điện thoại</a>&nbsp;l&agrave; camera Selfie được đặt ngay ngắn trong phần đục lỗ với độ ph&acirc;n giải 16MP để bạn s&aacute;ng tạo những bức ảnh ch&acirc;n dung đẹp tự nhi&ecirc;n, r&otilde; n&eacute;t.</strong></p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G chụp hình sắc nét\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h3.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3><strong>M&agrave;n h&igrave;nh tr&agrave;n viền 6.67&quot;, ph&acirc;n giải Full HD+</strong></h3>\r\n\r\n<p>Xiaomi Redmi Note 11 Pro 5G sở hữu m&agrave;n h&igrave;nh lớn 6.67&quot;,&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">độ ph&acirc;n giải Full HD+</a>&nbsp;c&ugrave;ng thiết kế tr&agrave;n viền - mở ra kh&ocirc;ng gian rộng lớn để người d&ugrave;ng xe