lỡ bất cứ ph&uacute;t gi&acirc;y giải tr&iacute; n&agrave;o. Theo Xiaomi c&ocirc;ng bố, m&aacute;y c&oacute; thể sạc 50% pin trong v&ograve;ng 15 ph&uacute;t v&agrave; 100% pin chỉ trong v&ograve;ng 42 ph&uacute;t.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Xiaomi Redmi Note 11 Pro 5G sạc nhanh chóng\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/XIAOMI/xiaomi-redmi-note-11-pro-5g-h11.png\" style=\"width:100%\" /></p>', 8990000, 'cc65aab772063360ed8d2b9bd3b4f53a.jpg', 95, 2100000, 'dien-thoai-xiaomi-redmi-note-11-pro-5g-8gb128gb-xanh-duong', 'active', 0, 'Xanh dương', 'AMOLED', 'Android 11', 'Snapdragon 695 5G 8 nhân', 'Full HD+ 1080 x 2340 pixels', '16MP', '108 MP, 8 MP, 2 MP', '8 GB', '128 GB', '2 Nano SIM', '5000 mAh', 4, '2023-05-07 06:02:28', '2023-05-14 08:41:44'),
(67, 'ME131359', 19, 'Điện thoại Realme 10 8GB/256GB Đen thiên thạch', '<h2>Điện thoại Realme 10 256GB - Bức ph&aacute; đỉnh cao, tỏa s&aacute;ng với diện mạo mới</h2>\r\n\r\n<h3>Thiết kế vi hạt &aacute;nh s&aacute;ng mới lạ</h3>\r\n\r\n<p>Realme 10 c&oacute; diện mạo độc đ&aacute;o, với ngoại h&igrave;nh vu&ocirc;ng vắn v&agrave; c&aacute;c g&oacute;c được bo nhẹ nh&agrave;ng, sang trọng, tinh tế mang lại c&aacute;i nh&igrave;n tổng thể đẹp mắt đầy sự mới lạ. Đồng thời gi&uacute;p bạn cầm nắm tr&ecirc;n tay thoải m&aacute;i hơn khi trọng lượng của m&aacute;y chỉ 178g.</p>\r\n\r\n<p><img alt=\"Realme 10 có thiết kế mới đẹp mắt\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/thiet-ke-vi-hat-anh-sang-realme10.jpg\" /></p>\r\n\r\n<p><em>Realme 10 c&oacute; thiết kế mới đẹp mắt</em></p>\r\n\r\n<p>Mặt lưng của Realme 10 được ho&agrave;n thiện từ chất liệu nhựa cao cấp, mang cảm gi&aacute;c chắc chắn khi chạm v&agrave;o. Ngo&agrave;i ra, thiết bị nổi bật với m&agrave;u chủ đạo gradient cho khả năng đổi m&agrave;u v&ocirc; c&ugrave;ng đẹp mắt khi nh&igrave;n theo c&aacute;c g&oacute;c kh&aacute;c nhau.</p>\r\n\r\n<p>Đặc biệt, h&atilde;ng c&ograve;n cho biết c&oacute; sự hiện diện của &ldquo;vi hạt &aacute;nh s&aacute;ng&rdquo;, đ&acirc;y l&agrave; c&aacute;ch gọi mới của lớp phủ tr&ecirc;n mặt lưng điện thoại t&ocirc; th&ecirc;m điểm s&aacute;ng lấp l&aacute;nh v&agrave; gi&uacute;p thiết bị trở n&ecirc;n lung linh hơn mỗi khi c&oacute; nguồn s&aacute;ng chiếu v&agrave;o.</p>\r\n\r\n<p><img alt=\"Realme 10 sở hữu lớp phủ đẹp mắt\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/mat-lung-realme10-co-mau-doc-dao.jpg\" /></p>\r\n\r\n<p><em>Realme 10 sở hữu lớp phủ đẹp mắt</em></p>\r\n\r\n<h3>M&agrave;n h&igrave;nh lớn, sử dụng tấm nền cao cấp</h3>\r\n\r\n<p>Điều đặc biệt kh&aacute;c tr&ecirc;n mẫu điện thoại&nbsp;Realme n&agrave;y&nbsp;phải kể đến l&agrave; thiết bị sử dụng&nbsp;<a href=\"https://dienmaycholon.vn/kinh-nghiem-mua-sam/cong-nghe-man-hinh-super-amoled-la-gi\" target=\"_blank\">tấm nền cao cấp Super AMOLED</a>&nbsp;đi k&egrave;m với độ ph&acirc;n giải FHD+ (1080 x 2400 Pixels), k&iacute;ch thước m&agrave;n h&igrave;nh 6.4 inch gi&uacute;p bạn xem phim, MV ca nhạc trở n&ecirc;n rực rỡ v&agrave; bắt mắt hơn.&nbsp;</p>\r\n\r\n<p>Ngo&agrave;i ra h&atilde;ng c&ograve;n trang bị tần số qu&eacute;t 90Hz mang đến cho người d&ugrave;ng khả năng chơi game v&agrave; lướt web mượt m&agrave;, ổn định.</p>\r\n\r\n<p><img alt=\"Realme 10 có công nghệ màn hình Super AMOLED\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-so-huu-man-hinh-super-amoled.jpg\" /></p>\r\n\r\n<p><em>Realme 10 c&oacute; c&ocirc;ng nghệ m&agrave;n h&igrave;nh Super AMOLED</em></p>\r\n\r\n<h3>Bắt kịp xu hướng Camera AI, chụp ảnh si&ecirc;u n&eacute;t</h3>\r\n\r\n<p><a href=\"https://www.realme.com/vn/\" target=\"_blank\">Realme</a>&nbsp;đ&atilde; bắt kịp được xu hướng khi t&iacute;ch hợp AI v&agrave;o Camera, mặt sau của điện thoại được trang bị bộ camera k&eacute;p c&oacute; cảm biến ch&iacute;nh l&agrave; 50MP, phụ 2MP. Nhờ camera c&oacute; độ ph&acirc;n giải cao gi&uacute;p cho điện thoại c&oacute; khả năng chụp si&ecirc;u n&eacute;t, chất ảnh c&oacute; độ chi tiết r&otilde; hơn bao giờ hết.</p>\r\n\r\n<p>Mặt trước Realme 10 256GB l&agrave; camera selfie c&oacute; độ ph&acirc;n giải 16MP, hứa hẹn sẽ cho ra những tấm h&igrave;nh selfie c&ugrave;ng bạn b&egrave; v&ocirc; c&ugrave;ng sắc n&eacute;t, m&agrave;u sắc r&otilde; r&agrave;ng, chi tiết tốt v&agrave; m&agrave;u da bắt mắt.</p>\r\n\r\n<p><img alt=\"Camera trên Realme 10 được nâng cấp\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-co-camera-50mp.jpg\" /></p>\r\n\r\n<p><em>Camera tr&ecirc;n Realme 10 được n&acirc;ng cấp</em></p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, chiếc&nbsp;<a href=\"https://dienmaycholon.vn/dien-thoai-di-dong\" target=\"_blank\">điện thoại di động</a>&nbsp;n&agrave;y&nbsp;c&ograve;n sở hữu nhiều c&aacute;c t&iacute;nh năng hữu &iacute;ch kh&aacute;c hỗ trợ tốt cho việc chụp ảnh từ cơ bản đến n&acirc;ng cao như: Chụp bằng cử chỉ, AI Camera, HDR, chuy&ecirc;n nghiệp (Pro), tự động l&agrave;m đẹp v&agrave; chụp si&ecirc;u độ ph&acirc;n giải.</p>\r\n\r\n<h3>Dẫn đầu hiệu năng khi sở hữu chip xịn</h3>\r\n\r\n<p>Realme 10 l&agrave; chiếc điện thoại flagship Android được h&atilde;ng trang bị con chip Helio G99 8 nh&acirc;n với tốc độ xung nhịp tối đa l&agrave; 2.2 GHz, đ&acirc;y được xem l&agrave; mẫu chipset gaming nổi bật trong bộ sưu tập của MediaTek.&nbsp;</p>\r\n\r\n<p>Nhờ vậy m&agrave; thiết bị c&oacute; hiệu năng đủ tốt v&agrave; mạnh mẽ để c&oacute; thể sử dụng trong thời gian d&agrave;i, đ&aacute;p ứng được t&aacute;c vụ th&ocirc;ng thường cho đến phức tạp.</p>\r\n\r\n<p><img alt=\"Realme 10 sở hữu chip “hịn” Helio G99\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-so-huu-con-chip-helio-g99.jpg\" /></p>\r\n\r\n<p><em>Realme 10 sở hữu chip &ldquo;hịn&rdquo; Helio G99</em></p>\r\n\r\n<p>Ngo&agrave;i ra, Realme 10 c&oacute; dung lượng ram 8GB, bộ nhớ trong 256GB v&agrave; được hỗ trợ mở rộng th&ecirc;m RAM ảo 8GB rất hữu &iacute;ch đối với những người c&oacute; nhu cầu về chỉnh sửa video, chơi game đồ họa cao hoặc sử dụng nhiều ứng dụng c&ugrave;ng một l&uacute;c.</p>\r\n\r\n<h3>Thời lượng Pin đ&aacute;p ứng đủ l&acirc;u</h3>\r\n\r\n<p>B&ecirc;n cạnh việc n&acirc;ng cấp hiệu năng, th&igrave; Pin của Realme 10 256GB c&ograve;n được đ&aacute;nh gi&aacute; kh&aacute; cao khi sở hữu dung lượng lớn 5000 mAh v&agrave; khả năng sạc si&ecirc;u nhanh nhờ c&ocirc;ng nghệ SuperVOOC 33W gi&uacute;p bạn tiết kiệm được kh&aacute; nhiều thời gian sạc. Từ đ&acirc;y, người d&ugrave;ng c&oacute; thể sử dụng&nbsp;<a href=\"http://dienmaycholon.vn/dien-thoai-di-dong-realme\" target=\"_blank\">điện thoại Realme</a>&nbsp;cả ng&agrave;y d&agrave;i m&agrave; kh&ocirc;ng phải qu&aacute; lo lắng về pin.</p>\r\n\r\n<p><img alt=\"Realme 10 có khả năng sạc nhanh ấn tượng\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-co-vien-pin-5000mah.jpg\" /></p>\r\n\r\n<p><em>Realme 10 c&oacute; khả năng sạc nhanh ấn tượng</em></p>\r\n\r\n<h3>Khả năng kết nối v&agrave; tiện &iacute;ch kh&aacute;c</h3>\r\n\r\n<p>Realme 10 c&ograve;n c&oacute; nhiều c&ocirc;ng nghệ kết nối hữu &iacute;ch kh&aacute;c như: Hỗ trợ 4G, 2 nano Sim, Wi-Fi 802.11 chuẩn a/b/g/n/ (2.4 GHz/5 GHz), OTG, chế độ tăng &acirc;m lượng 200%. C&ugrave;ng với đ&oacute; l&agrave; khả năng mở kh&oacute;a bằng khu&ocirc;n mặt hoặc mở kh&oacute;a v&acirc;n tay cạnh viền, gi&uacute;p bạn bảo mật v&agrave; mở m&aacute;y nhanh ch&oacute;ng.</p>\r\n\r\n<p><img alt=\"Realme 10 có khả năng boost âm thanh lên 200%\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-co-kha-nang-tang-am-thanh.jpg\" /></p>', 7190000, '5ec5c600d0c5158cbd7e313a8ad17084.jpg', 97, 1300000, 'dien-thoai-realme-10-8gb256gb-den-thien-thach', 'active', 0, 'Đen thiên thạch', 'Super AMOLED', 'Android 12, Realme UI 3.0', 'Helio G99', '(FHD+) 1080 x 2400 pixels', '16MP', '50 MP, 2 MP', '8 GB', '256 GB', 'Dual SIM (Nano-SIM)', '5000 mAh', 4, '2023-05-07 06:13:59', '2023-05-14 08:44:34'),
