s://dienmaycholon.vn/kinh-nghiem-mua-sam/cong-nghe-man-hinh-super-amoled-la-gi\" target=\"_blank\">tấm nền cao cấp Super AMOLED</a>&nbsp;đi k&egrave;m với độ ph&acirc;n giải FHD+ (1080 x 2400 Pixels), k&iacute;ch thước m&agrave;n h&igrave;nh 6.4 inch gi&uacute;p bạn xem phim, MV ca nhạc trở n&ecirc;n rực rỡ v&agrave; bắt mắt hơn.&nbsp;</p>\r\n\r\n<p>Ngo&agrave;i ra h&atilde;ng c&ograve;n trang bị tần số qu&eacute;t 90Hz mang đến cho người d&ugrave;ng khả năng chơi game v&agrave; lướt web mượt m&agrave;, ổn định.</p>\r\n\r\n<p><img alt=\"Realme 10 có công nghệ màn hình Super AMOLED\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-so-huu-man-hinh-super-amoled.jpg\" /></p>\r\n\r\n<p><em>Realme 10 c&oacute; c&ocirc;ng nghệ m&agrave;n h&igrave;nh Super AMOLED</em></p>\r\n\r\n<h3>Bắt kịp xu hướng Camera AI, chụp ảnh si&ecirc;u n&eacute;t</h3>\r\n\r\n<p><a href=\"https://www.realme.com/vn/\" target=\"_blank\">Realme</a>&nbsp;đ&atilde; bắt kịp được xu hướng khi t&iacute;ch hợp AI v&agrave;o Camera, mặt sau của điện thoại được trang bị bộ camera k&eacute;p c&oacute; cảm biến ch&iacute;nh l&agrave; 50MP, phụ 2MP. Nhờ camera c&oacute; độ ph&acirc;n giải cao gi&uacute;p cho điện thoại c&oacute; khả năng chụp si&ecirc;u n&eacute;t, chất ảnh c&oacute; độ chi tiết r&otilde; hơn bao giờ hết.</p>\r\n\r\n<p>Mặt trước Realme 10 256GB l&agrave; camera selfie c&oacute; độ ph&acirc;n giải 16MP, hứa hẹn sẽ cho ra những tấm h&igrave;nh selfie c&ugrave;ng bạn b&egrave; v&ocirc; c&ugrave;ng sắc n&eacute;t, m&agrave;u sắc r&otilde; r&agrave;ng, chi tiết tốt v&agrave; m&agrave;u da bắt mắt.</p>\r\n\r\n<p><img alt=\"Camera trên Realme 10 được nâng cấp\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-co-camera-50mp.jpg\" /></p>\r\n\r\n<p><em>Camera tr&ecirc;n Realme 10 được n&acirc;ng cấp</em></p>\r\n\r\n<p>B&ecirc;n cạnh đ&oacute;, chiếc&nbsp;<a href=\"https://dienmaycholon.vn/dien-thoai-di-dong\" target=\"_blank\">điện thoại di động</a>&nbsp;n&agrave;y&nbsp;c&ograve;n sở hữu nhiều c&aacute;c t&iacute;nh năng hữu &iacute;ch kh&aacute;c hỗ trợ tốt cho việc chụp ảnh từ cơ bản đến n&acirc;ng cao như: Chụp bằng cử chỉ, AI Camera, HDR, chuy&ecirc;n nghiệp (Pro), tự động l&agrave;m đẹp v&agrave; chụp si&ecirc;u độ ph&acirc;n giải.</p>\r\n\r\n<h3>Dẫn đầu hiệu năng khi sở hữu chip xịn</h3>\r\n\r\n<p>Realme 10 l&agrave; chiếc điện thoại flagship Android được h&atilde;ng trang bị con chip Helio G99 8 nh&acirc;n với tốc độ xung nhịp tối đa l&agrave; 2.2 GHz, đ&acirc;y được xem l&agrave; mẫu chipset gaming nổi bật trong bộ sưu tập của MediaTek.&nbsp;</p>\r\n\r\n<p>Nhờ vậy m&agrave; thiết bị c&oacute; hiệu năng đủ tốt v&agrave; mạnh mẽ để c&oacute; thể sử dụng trong thời gian d&agrave;i, đ&aacute;p ứng được t&aacute;c vụ th&ocirc;ng thường cho đến phức tạp.</p>\r\n\r\n<p><img alt=\"Realme 10 sở hữu chip “hịn” Helio G99\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-so-huu-con-chip-helio-g99.jpg\" /></p>\r\n\r\n<p><em>Realme 10 sở hữu chip &ldquo;hịn&rdquo; Helio G99</em></p>\r\n\r\n<p>Ngo&agrave;i ra, Realme 10 c&oacute; dung lượng ram 8GB, bộ nhớ trong 256GB v&agrave; được hỗ trợ mở rộng th&ecirc;m RAM ảo 8GB rất hữu &iacute;ch đối với những người c&oacute; nhu cầu về chỉnh sửa video, chơi game đồ họa cao hoặc sử dụng nhiều ứng dụng c&ugrave;ng một l&uacute;c.</p>\r\n\r\n<h3>Thời lượng Pin đ&aacute;p ứng đủ l&acirc;u</h3>\r\n\r\n<p>B&ecirc;n cạnh việc n&acirc;ng cấp hiệu năng, th&igrave; Pin của Realme 10 256GB c&ograve;n được đ&aacute;nh gi&aacute; kh&aacute; cao khi sở hữu dung lượng lớn 5000 mAh v&agrave; khả năng sạc si&ecirc;u nhanh nhờ c&ocirc;ng nghệ SuperVOOC 33W gi&uacute;p bạn tiết kiệm được kh&aacute; nhiều thời gian sạc. Từ đ&acirc;y, người d&ugrave;ng c&oacute; thể sử dụng&nbsp;<a href=\"http://dienmaycholon.vn/dien-thoai-di-dong-realme\" target=\"_blank\">điện thoại Realme</a>&nbsp;cả ng&agrave;y d&agrave;i m&agrave; kh&ocirc;ng phải qu&aacute; lo lắng về pin.</p>\r\n\r\n<p><img alt=\"Realme 10 có khả năng sạc nhanh ấn tượng\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-co-vien-pin-5000mah.jpg\" /></p>\r\n\r\n<p><em>Realme 10 c&oacute; khả năng sạc nhanh ấn tượng</em></p>\r\n\r\n<h3>Khả năng kết nối v&agrave; tiện &iacute;ch kh&aacute;c</h3>\r\n\r\n<p>Realme 10 c&ograve;n c&oacute; nhiều c&ocirc;ng nghệ kết nối hữu &iacute;ch kh&aacute;c như: Hỗ trợ 4G, 2 nano Sim, Wi-Fi 802.11 chuẩn a/b/g/n/ (2.4 GHz/5 GHz), OTG, chế độ tăng &acirc;m lượng 200%. C&ugrave;ng với đ&oacute; l&agrave; khả năng mở kh&oacute;a bằng khu&ocirc;n mặt hoặc mở kh&oacute;a v&acirc;n tay cạnh viền, gi&uacute;p bạn bảo mật v&agrave; mở m&aacute;y nhanh ch&oacute;ng.</p>\r\n\r\n<p><img alt=\"Realme 10 có khả năng boost âm thanh lên 200%\" src=\"https://cdn11.dienmaycholon.vn/filewebdmclnew/public/userupload/files/mtsp/di-dong/realme10-co-kha-nang-tang-am-thanh.jpg\" /></p>', 7190000, '764a4ddf7da2906f94497784ed7546cc.jpg', 97, 1300000, 'dien-thoai-realme-10-8gb256gb-trang-cuc-quang', 'active', 0, 'Trắng cực quang', 'Super AMOLED', 'Android 12, Realme UI 3.0', 'Helio G99', '(FHD+) 1080 x 2400 pixels', '16MP', '50 MP, 2 MP', '8 GB', '256 GB', 'Dual SIM (Nano-SIM)', '5000 mAh', 1, '2023-05-07 06:17:02', '2023-05-14 08:36:33');
INSERT INTO `products` (`id`, `code`, `category_id`, `name`, `description`, `price`, `featured_image`, `quantity`, `discount`, `slug`, `status`, `featured`, `color`, `screen_technology`, `os`, `cpu`, `resolution`, `front_camera`, `rear_camera`, `ram`, `rom`, `sim`, `pin`, `view_count`, `created_at`, `updated_at`) VALUES
(69, 'GI132857', 14, 'Điện thoại iPhone 13 Pro Max 512GB Xám', '<h3>Thiết kế ấn tượng, đa m&agrave;u sắc&nbsp;</h3>\r\n\r\n<p>Tương tự như iPhone 12, điện thoại iPhone 13 Pro Max&nbsp;cũng sở hữu thiết kế sang trọng với c&aacute;c viền canh m&aacute;y được l&agrave;m phẳng, c&aacute;c chi tiết g&oacute;c cạnh được l&agrave;m tỉ mỉ tạo n&ecirc;n một chiếc iPhone si&ecirc;u xịn, đ&aacute;p ứng nhu cầu thẩm mỹ người d&ugrave;ng.&nbsp;</p>\r\n\r\n<p>iPhone 13 Pro Max được ho&agrave;n chỉnh với thiết kế nguy&ecirc;n khối bằng chất liệu th&eacute;p kh&ocirc;ng gỉ. 2 mặt của m&aacute;y được l&agrave;m bằng k&iacute;nh cường lực Ceramic Shield. Chỉ c&oacute; một phần kh&aacute;c biệt l&agrave; ở camera m&aacute;y nay đ&atilde; to hơn rất nhiều khi so với phi&ecirc;n bản tiền nhiệm. L&iacute; do cho việc n&agrave;y l&agrave; v&igrave; Apple đ&atilde; n&acirc;ng cấp khẩu độ của chiếc camera n&ecirc;n khiến n&oacute; to hơn n&ecirc;n c&aacute;c linh kiện phần cứng&nbsp;của camera cũng to hơn.</p>\r\n\r\n<p><img alt=\"Thiết kế ấn tượng, đa màu sắc \" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-1-didongviet.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>iPhone 13 Pro Max&nbsp;kh&ocirc;ng chỉ sở hữu thiết kế đẹp, sang trọng m&agrave; m&aacute;y được trang bị đầy đủ c&aacute;c t&iacute;nh năng như chống nước đạt chuản IP68. M&aacute;y c&ograve;n được phủ th&ecirc;m một lớp chống v&acirc;n tay ở viền tr&ecirc;n m&aacute;y gi&uacute;p hạn chế tối đa khả năng b&aacute;m v&acirc;n tay tr&ecirc;n sản phẩm.Với iPhone 13 Pro Max người d&ugrave;ng c&oacute; thể thoải m&aacute;i lựa chọn c&aacute;c phi&ecirc;n bản m&agrave;u sắc kh&aacute;c nhau để đ&aacute;p ứng nhu cầu thẩm mỹ của m&igrave;nh.&nbsp;</p>\r\n\r\n<h3>M&agrave;n h&igrave;nh k&iacute;ch thước 6.7 inch, tốc độ 120Hz</h3>\r\n\r\n<p>iPhone 13 Pro Max sẽ c&oacute; k&iacute;ch thước m&agrave;n h&igrave;nh đến 6.7 inch, c&ugrave;ng với đ&oacute; l&agrave; tấm nền Super Retina XDR OLED, hứa hẹn sẽ đem đến một kh&ocirc;ng gian hiển thị v&ocirc; c&ugrave;ng rộng lớn c&ugrave;ng chất lượng m&agrave;u sắc tinh tế. Đặc biệt hơn phần notch sẽ được l&agrave;m ngắn lại khoảng 20%, g&oacute;p phần l&agrave;m cho kh&ocirc;ng gian m&agrave;n h&igrave;nh th&ecirc;m rộng hơn.</p>\r\n\r\n<p><img alt=\"Màn hình kích thước 6.7 inch, tốc độ 120Hz\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-7-didongviet.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, m&agrave;n h&igrave;nh iPhone 13 Pro Max với tốc độ l&agrave;m tươi đạt 120Hz sẽ gi&uacute;p h&igrave;nh ảnh, m&agrave;u sắc tr&ecirc;n m&aacute;y chuyển động 1 c&aacute;ch mượt m&agrave; hơn. V&agrave; n&oacute; sẽ đ&aacute;nh dấu bước chuyển đổi quan trọng tr&ecirc;n m&agrave;n h&igrave;nh iPhone 13 Pro Series.&nbsp;</p>\r\n\r\n<h3>Hiệu năng cao cấp với chip Apple A15</h3>\r\n\r\n<p>Với mỗi thế hệ iPhone, Apple lại cố gắng mang đến những n&acirc;ng cấp đ&aacute;ng kể, đặc biệt l&agrave; cấu h&igrave;nh. iPhone 13 series ra mắt 2021 sẽ được trang bị cấu h&igrave;nh mạnh mẽ với chip A15 Bionic v&agrave; hỗ trợ cả mạng 5G mang đến tốc độ cao. Tốc độ nhanh hơn 50% so với c&aacute;c chip kh&aacute;c tr&ecirc;n thị trường) c&ugrave;ng 15 tỉ b&oacute;ng b&aacute;n dẫn gi&uacute;p hiệu năng CPU nhanh hơn 40% v&agrave; GPU nhanh hơn&nbsp;80% so với thế hệ tiền nhiệm.</p>\r\n\r\n<p><img alt=\"Hiệu năng cao cấp với chip Apple A15\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-5-didongviet.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>Đi k&egrave;m với 16 nh&acirc;n Neural Engine gi&uacute;p khả năng m&aacute;y học (Machine Learning) tr&ecirc;n iPhone 13 Pro Max được cải thiện hơn. Gi&uacute;p những t&aacute;c vụ li&ecirc;n quan đến m&aacute;y học như Live text, Emoji, sạc pin,... trở n&ecirc;n tối ưu hơn.</p>\r\n\r\n<p>iPhone 13 Pro Max&nbsp;c&oacute; thể c&acirc;n hầu hết mọi tựa game nặng tr&ecirc;n thị trường như PUBG Mobile, Genshin Impact, COD Online một c&aacute;ch mượt m&agrave; với cấu h&igrave;nh đồ họa ở mức c&agrave;i đặt cao nhất. Kết hợp với m&agrave;n h&igrave;nh 120Hz sẽ mang lại cho người d&ugrave;ng trải nghiệm giải tr&iacute;, chơi game v&ocirc; c&ugrave;ng tuyệt vời.</p>\r\n\r\n<h3>Camera cao cấp với nhiều t&iacute;nh năng chụp ảnh mới</h3>\r\n\r\n<p>iPhone 13 Pro Max&nbsp;sẽ c&oacute; cụm camera với thiết kế to hơn, lồi hơn 1 ch&uacute;t so với phi&ecirc;n bản tiền nhiệm. Tương tư với d&ograve;ng iPhone 12 Pro Max, sản phẩm cũng sở hữu hệ thống 3 camera bao gồm: camera g&oacute;c rộng, camera g&oacute;c si&ecirc;u rộng c&ugrave;ng camera tele c&ugrave;ng độ ph&acirc;n giải 12MP v&agrave; cảm biến LiDAR.</p>\r\n\r\n<p><img alt=\"Camera cao cấp với nhiều tính năng chụp ảnh mới\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-4-didongviet.jpg\" style=\"height:520px; width:780px\" /></p>\r\n\r\n<p>Với cảm biến v&agrave; ống k&iacute;nh mới cho cả ba camera ph&iacute;a sau, kết hợp với sự tối ưu từ iOS 15 v&agrave; bộ xử l&yacute; t&iacute;n hiệu h&igrave;nh ảnh (ISP) trong vi xử l&yacute; A15 Bionic sẽ gi&uacute;p chiếc m&aacute;y cải thiện khả năng khử nhiễu, c&acirc;n bằng trắng cũng như &aacute;nh s&aacute;ng tr&ecirc;n bức ảnh tốt hơn. Từ đ&oacute; gi&uacute;p người d&ugrave;ng chụp ra được những bức ảnh c&oacute; m&agrave;u sắc đẹp hơn, ch&acirc;n thật hơn.</p>\r\n\r\n<p><img alt=\"\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-6-didongviet.jpg\" /></p>\r\n\r\n<p>Về phần camera trước&nbsp;của thiết bị sẽ c&oacute; độ ph&acirc;n giải 12MP với cảm biến lớn hơn. iPhone 13 Pro Max c&oacute; thể chụp ảnh selfie g&oacute;c rộng hơn so với thế hệ trước. Những t&iacute;nh năng selfie như: slow-motion, memoji v&agrave; animoji cũng sẽ xuất hiện.</p>', 46990000, '4887b8feb8f6ff5cb5867111d65ae26e.jpg', 98, 0, 'dien-thoai-iphone-13-pro-max-512gb-xam', 'active', 0, 'Xám', 'OLED', 'iOS 15', 'Apple A15 Bionic', '1284 x 2778 pixels', '12MP', '12MP-12MP-12MP', '6 GB', '512 GB', '1 Nano SIM & 1 eSIM', '4352 mAh', 3, '2023-05-07 06:28:57', '2023-05-14 08:36:33'),
(70, 'IE133255', 14, 'Điện thoại iPhone 13 Pro Max 512GB Xanh Dương', '<h3>Thiết kế ấn tượng, đa m&agrave;u sắc&nbsp;</h3>\r\n\r\n<p>Tương tự như iPhone 12, điện thoại iPhone 13 Pro Max&nbsp;cũng sở hữu thiết kế sang trọng với c&aacute;c viền canh m&aacute;y được l&agrave;m phẳng, c&aacute;c chi tiết g&oacute;c cạnh được l&agrave;m tỉ mỉ tạo n&ecirc;n một chiếc iPhone si&ecirc;u xịn, đ&aacute;p ứng nhu cầu thẩm mỹ người d&ugrave;ng.&nbsp;</p>\r\n\r\n<p>iPhone 13 Pro Max được ho&agrave;n chỉnh với thiết kế nguy&ecirc;n khối bằng chất liệu th&eacute;p kh&ocirc;ng gỉ. 2 mặt của m&aacute;y được l&agrave;m bằng k&iacute;nh cường lực Ceramic Shield. Chỉ c&oacute; một phần kh&aacute;c biệt l&agrave; ở camera m&aacute;y nay đ&atilde; to hơn rất nhiều khi so với phi&ecirc;n bản tiền nhiệm. L&iacute; do cho việc n&agrave;y l&agrave; v&igrave; Apple đ&atilde; n&acirc;ng cấp khẩu độ của chiếc camera n&ecirc;n khiến n&oacute; to hơn n&ecirc;n c&aacute;c linh kiện phần cứng&nbsp;của camera cũng to hơn.</p>\r\n\r\n<p><img alt=\"Thiết kế ấn tượng, đa màu sắc \" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-1-didongviet.jpg\" /></p>\r\n\r\n<p>iPhone 13 Pro Max&nbsp;kh&ocirc;ng chỉ sở hữu thiết kế đẹp, sang trọng m&agrave; m&aacute;y được trang bị đầy đủ c&aacute;c t&iacute;nh năng như chống nước đạt chuản IP68. M&aacute;y c&ograve;n được phủ th&ecirc;m một lớp chống v&acirc;n tay ở viền tr&ecirc;n m&aacute;y gi&uacute;p hạn chế tối đa khả năng b&aacute;m v&acirc;n tay tr&ecirc;n sản phẩm.Với iPhone 13 Pro Max người d&ugrave;ng c&oacute; thể thoải m&aacute;i lựa chọn c&aacute;c phi&ecirc;n bản m&agrave;u sắc kh&aacute;c nhau để đ&aacute;p ứng nhu cầu thẩm mỹ của m&igrave;nh.&nbsp;</p>\r\n\r\n<h3>M&agrave;n h&igrave;nh k&iacute;ch thước 6.7 inch, tốc độ 120Hz</h3>\r\n\r\n<p>iPhone 13 Pro Max sẽ c&oacute; k&iacute;ch thước m&agrave;n h&igrave;nh đến 6.7 inch, c&ugrave;ng với đ&oacute; l&agrave; tấm nền Super Retina XDR OLED, hứa hẹn sẽ đem đến một kh&ocirc;ng gian hiển thị v&ocirc; c&ugrave;ng rộng lớn c&ugrave;ng chất lượng m&agrave;u sắc tinh tế. Đặc biệt hơn phần notch sẽ được l&agrave;m ngắn lại khoảng 20%, g&oacute;p phần l&agrave;m cho kh&ocirc;ng gian m&agrave;n h&igrave;nh th&ecirc;m rộng hơn.</p>\r\n\r\n<p><img alt=\"Màn hình kích thước 6.7 inch, tốc độ 120Hz\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-7-didongviet.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, m&agrave;n h&igrave;nh iPhone 13 Pro Max với tốc độ l&agrave;m tươi đạt 120Hz sẽ gi&uacute;p h&igrave;nh ảnh, m&agrave;u sắc tr&ecirc;n m&aacute;y chuyển động 1 c&aacute;ch mượt m&agrave; hơn. V&agrave; n&oacute; sẽ đ&aacute;nh dấu bước chuyển đổi quan trọng tr&ecirc;n m&agrave;n h&igrave;nh iPhone 13 Pro Series.&nbsp;</p>\r\n\r\n<h3>Hiệu năng cao cấp với chip Apple A15</h3>\r\n\r\n<p>Với mỗi thế hệ iPhone, Apple lại cố gắng mang đến những n&acirc;ng cấp đ&aacute;ng kể, đặc biệt l&agrave; cấu h&igrave;nh. iPhone 13 series ra mắt 2021 sẽ được trang bị cấu h&igrave;nh mạnh mẽ với chip A15 Bionic v&agrave; hỗ trợ cả mạng 5G mang đến tốc độ cao. Tốc độ nhanh hơn 50% so với c&aacute;c chip kh&aacute;c tr&ecirc;n thị trường) c&ugrave;ng 15 tỉ b&oacute;ng b&aacute;n dẫn gi&uacute;p hiệu năng CPU nhanh hơn 40% v&agrave; GPU nhanh hơn&nbsp;80% so với thế hệ tiền nhiệm.</p>\r\n\r\n<p><img alt=\"Hiệu năng cao cấp với chip Apple A15\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-5-didongviet.jpg\" /></p>\r\n\r\n<p>Đi k&egrave;m với 16 nh&acirc;n Neural Engine gi&uacute;p khả năng m&aacute;y học (Machine Learning) tr&ecirc;n iPhone 13 Pro Max được cải thiện hơn. Gi&uacute;p những t&aacute;c vụ li&ecirc;n quan đến m&aacute;y học như Live text, Emoji, sạc pin,... trở n&ecirc;n tối ưu hơn.</p>\r\n\r\n<p>iPhone 13 Pro Max&nbsp;c&oacute; thể c&acirc;n hầu hết mọi tựa game nặng tr&ecirc;n thị trường như PUBG Mobile, Genshin Impact, COD Online một c&aacute;ch mượt m&agrave; với cấu h&igrave;nh đồ họa ở mức c&agrave;i đặt cao nhất. Kết hợp với m&agrave;n h&igrave;nh 120Hz sẽ mang lại cho người d&ugrave;ng trải nghiệm giải tr&iacute;, chơi game v&ocirc; c&ugrave;ng tuyệt vời.</p>\r\n\r\n<h3>Camera cao cấp với nhiều t&iacute;nh năng chụp ảnh mới</h3>\r\n\r\n<p>iPhone 13 Pro Max&nbsp;sẽ c&oacute; cụm camera với thiết kế to hơn, lồi hơn 1 ch&uacute;t so với phi&ecirc;n bản tiền nhiệm. Tương tư với d&ograve;ng iPhone 12 Pro Max, sản phẩm cũng sở hữu hệ thống 3 camera bao gồm: camera g&oacute;c rộng, camera g&oacute;c si&ecirc;u rộng c&ugrave;ng camera tele c&ugrave;ng độ ph&acirc;n giải 12MP v&agrave; cảm biến LiDAR.</p>\r\n\r\n<p><img alt=\"Camera cao cấp với nhiều tính năng chụp ảnh mới\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-4-didongviet.jpg\" /></p>\r\n\r\n<p>Với cảm biến v&agrave; ống k&iacute;nh mới cho cả ba camera ph&iacute;a sau, kết hợp với sự tối ưu từ iOS 15 v&agrave; bộ xử l&yacute; t&iacute;n hiệu h&igrave;nh ảnh (ISP) trong vi xử l&yacute; A15 Bionic sẽ gi&uacute;p chiếc m&aacute;y cải thiện khả năng khử nhiễu, c&acirc;n bằng trắng cũng như &aacute;nh s&aacute;ng tr&ecirc;n bức ảnh tốt hơn. Từ đ&oacute; gi&uacute;p người d&ugrave;ng chụp ra được những bức ảnh c&oacute; m&agrave;u sắc đẹp hơn, ch&acirc;n thật hơn.</p>\r\n\r\n<p><img alt=\"\" src=\"https://cdn-v2.didongviet.vn/files/media/A-iPhone-13/iphone-13-pro-max-512gb/iphone-13-pro-max-sierra-blue-6-didongviet.jpg\" /></p>\r\n\r\n<p>Về phần camera trước&nbsp;của thiết bị sẽ c&oacute; độ ph&acirc;n giải 12MP với cảm biến lớn hơn. iPhone 13 Pro Max c&oacute; thể chụp ảnh selfie g&oacute;c rộng hơn so với thế hệ trước. Những t&iacute;nh năng selfie như: slow-motion, memoji v&agrave; animoji cũng sẽ xuất hiện.</p>', 46990000, '1b5fe1b60a1319ea870464966e7e740a.jpg', 99, 0, 'dien-thoai-iphone-13-pro-max-512gb-xanh-duong', 'active', 1, 'Xám', 'OLED', 'iOS 15', 'iOS 15', '1284 x 2778 pixels', '12MP', '12MP-12MP-12MP', '6 GB', '512 GB', '1 Nano SIM & 1 eSIM', '4352 mAh', 3, '2023-05-07 06:32:55', '2023-05-11 03:46:12'),
(71, 'PF133808', 21, 'Điện thoại Nokia G11 Plus 3GB/64GB Xanh', '<h3>Diện mạo sang trọng, chất lượng bền bỉ chuẩn ch&acirc;u &Acirc;u</h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/dien-thoai-di-dong-nokia/\">Điện thoại Nokia G11 Plus</a>&nbsp;sở hữu khung viền l&agrave;m bằng hợp kim Nh&ocirc;m được bo tr&ograve;n tỉ mỉ, mặt lưng l&agrave;m từ&nbsp;chất liệu&nbsp;polycarbonate thiết kế dạng v&acirc;n nhỏ n&ecirc;n hạn chế b&aacute;m v&acirc;n tay, tạo cảm gi&aacute;c cầm nắm th&iacute;ch th&uacute; cũng như hạn chế tối đa trơn tuột m&aacute;y khỏi tay khi cầm. Hai chất liệu kể tr&ecirc;n cũng rất bền chắc, bảo vệ khỏi những t&aacute;c động h&agrave;ng ng&agrave;y. C&ugrave;ng với đ&oacute; l&agrave; khả năng kh&aacute;ng nước bảo vệ thiết bị khỏi t&aacute;c động từ m&ocirc;i trường để mỗi cuộc phi&ecirc;u lưu h&agrave;ng ng&agrave;y lu&ocirc;n đầy hứng khởi. Thiết kế đậm n&eacute;t Bắc &Acirc;u với m&agrave;u sắc mạnh mẽ, thời thượng bao&nbsp;gồm&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-nokia-g11-plus-3gb-64gb-xam.html\">X&aacute;m Than</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-nokia-g11-plus-3gb-64gb-xanh.html\">Xanh Thi&ecirc;n H&agrave;</a>&nbsp;để bạn lựa chọn t&ugrave;y sở th&iacute;ch.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus thiết kế đẹp mắt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Vi&ecirc;n pin 5000mAh, năng lượng bền bỉ</h3>\r\n\r\n<p>Điện thoại G11 Plus sở hữu vi&ecirc;n pin dung lượng lớn l&ecirc;n tới 5000mAh, cho khả năng k&eacute;o d&agrave;i thời gian sử dụng bền bỉ suốt ng&agrave;y d&agrave;i. Đ&acirc;y hứa hẹn l&agrave; chiếc&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-di-dong/\">smartphone</a>&nbsp;l&yacute; tưởng cho những người bận rộn n&ecirc;n muốn sở hữu thiết bị với pin &ldquo;tr&acirc;u&rdquo; để thoải m&aacute;i sử dụng.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus dung lượng pin lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-3.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus màn hình rộng\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-4.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>M&agrave;n h&igrave;nh lớn&nbsp;6.5&#39;&#39; chuẩn HD+</h3>\r\n\r\n<p>Điện thoại m&agrave;n h&igrave;nh lớn 6.5 inch để bạn thoải m&aacute;i thưởng thức mọi h&igrave;nh ảnh v&agrave; thước phim, giảm t&igrave;nh trạng mỏi mắt. Thiết kế m&agrave;n h&igrave;nh giọt nước tăng kh&ocirc;ng gian hiển thị, c&ugrave;ng độ ph&acirc;n giải&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">m&agrave;n h&igrave;nh HD+</a>&nbsp;t&aacute;i tạo h&igrave;nh ảnh với độ sắc n&eacute;t cao, m&agrave;u sắc ch&acirc;n thực.</p>\r\n\r\n<h3>Chip&nbsp;Unisoc T606, thao t&aacute;c &ecirc;m mượt</h3>\r\n\r\n<p>Nhờ trang bị bộ vi xử l&yacute; Unisoc T606, G11 Plus cho hiệu năng ổn định để xử l&yacute; mượt m&agrave; c&aacute;c t&aacute;c vụ học tập, c&ocirc;ng việc, chơi game th&ocirc;ng thường. Bộ nhớ trong 64GB cho bạn kh&ocirc;ng gian lưu trữ h&igrave;nh ảnh, dữ liệu thoải m&aacute;i.</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus hiệu năng mạnh mẽ\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-5.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus camera kép chụp ảnh đẹp\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-7.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Camera k&eacute;p trang bị c&aacute;c t&iacute;nh năng l&agrave;m đẹp</h3>\r\n\r\n<p>Ghi lại mọi khoảnh khắc trong cuộc sống th&ocirc;ng qua những bức ảnh to&agrave;n cảnh, cận cảnh hay ch&acirc;n dung của bản th&acirc;n đẹp tự nhi&ecirc;n, sắc n&eacute;t với G11 Plus. Bởi m&aacute;y trang bị camera k&eacute;p&nbsp;50MP - 2MP k&egrave;m đ&egrave;n flash ph&iacute;a sau, ph&iacute;a trước l&agrave; camera Selfie 8MP gi&uacute;p bạn tự tay s&aacute;ng tạo những khung ảnh đẹp ấn tượng.</p>\r\n\r\n<h3>Mở kh&oacute;a v&acirc;n tay, mở kh&oacute;a khu&ocirc;n mặt&nbsp;</h3>\r\n\r\n<p>D&ugrave; c&oacute; mức gi&aacute; hết sức b&igrave;nh d&acirc;n nhưng G11 Plus được Nokia trang bị cả 2 c&ocirc;ng nghệ ti&ecirc;n tiến c&oacute; tr&ecirc;n c&aacute;c d&ograve;ng điện thoại Flagship cao cấp đ&oacute; l&agrave; Cảm biến v&acirc;n tay v&agrave; Nhận diện khu&ocirc;n mặt để bạn mở kh&oacute;a nhanh ch&oacute;ng, an to&agrave;n, tăng cường bảo mật cho thiết bị c&aacute; nh&acirc;n của m&igrave;nh.</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus mở khóa vân tay và khuôn mặt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-9.jpg\" style=\"width:100%\" /></p>', 3590000, 'bd16c285cba01fb81f3f5a1af4ac21cc.jpg', 94, 1100000, 'dien-thoai-nokia-g11-plus-3gb64gb-xanh', 'active', 1, 'Xanh', 'TFT LCD', 'Android™ 12', 'Unisoc T606 (12 nm)', 'HD+ (720 x 1600) pixels', '8MP, FF (f/2.0)', '50MP Chính AF (f/1.8) + 2MP Chiều sâu FF', '3 GB', '64 GB', 'Nano', '5000 mAh', 2, '2023-05-07 06:38:08', '2023-05-14 08:44:34'),
(72, 'QZ134050', 21, 'Điện thoại Nokia G11 Plus 3GB/64GB Xám', '<h3>Diện mạo sang trọng, chất lượng bền bỉ chuẩn ch&acirc;u &Acirc;u</h3>\r\n\r\n<p><a href=\"https://www.nguyenkim.com/dien-thoai-di-dong-nokia/\">Điện thoại Nokia G11 Plus</a>&nbsp;sở hữu khung viền l&agrave;m bằng hợp kim Nh&ocirc;m được bo tr&ograve;n tỉ mỉ, mặt lưng l&agrave;m từ&nbsp;chất liệu&nbsp;polycarbonate thiết kế dạng v&acirc;n nhỏ n&ecirc;n hạn chế b&aacute;m v&acirc;n tay, tạo cảm gi&aacute;c cầm nắm th&iacute;ch th&uacute; cũng như hạn chế tối đa trơn tuột m&aacute;y khỏi tay khi cầm. Hai chất liệu kể tr&ecirc;n cũng rất bền chắc, bảo vệ khỏi những t&aacute;c động h&agrave;ng ng&agrave;y. C&ugrave;ng với đ&oacute; l&agrave; khả năng kh&aacute;ng nước bảo vệ thiết bị khỏi t&aacute;c động từ m&ocirc;i trường để mỗi cuộc phi&ecirc;u lưu h&agrave;ng ng&agrave;y lu&ocirc;n đầy hứng khởi. Thiết kế đậm n&eacute;t Bắc &Acirc;u với m&agrave;u sắc mạnh mẽ, thời thượng bao&nbsp;gồm&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-nokia-g11-plus-3gb-64gb-xam.html\">X&aacute;m Than</a>&nbsp;v&agrave;&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-nokia-g11-plus-3gb-64gb-xanh.html\">Xanh Thi&ecirc;n H&agrave;</a>&nbsp;để bạn lựa chọn t&ugrave;y sở th&iacute;ch.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus thiết kế đẹp mắt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Vi&ecirc;n pin 5000mAh, năng lượng bền bỉ</h3>\r\n\r\n<p>Điện thoại G11 Plus sở hữu vi&ecirc;n pin dung lượng lớn l&ecirc;n tới 5000mAh, cho khả năng k&eacute;o d&agrave;i thời gian sử dụng bền bỉ suốt ng&agrave;y d&agrave;i. Đ&acirc;y hứa hẹn l&agrave; chiếc&nbsp;<a href=\"https://www.nguyenkim.com/dien-thoai-di-dong/\">smartphone</a>&nbsp;l&yacute; tưởng cho những người bận rộn n&ecirc;n muốn sở hữu thiết bị với pin &ldquo;tr&acirc;u&rdquo; để thoải m&aacute;i sử dụng.&nbsp;</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus dung lượng pin lớn\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-2.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus màn hình rộng\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-4.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>M&agrave;n h&igrave;nh lớn&nbsp;6.5&#39;&#39; chuẩn HD+</h3>\r\n\r\n<p>Điện thoại m&agrave;n h&igrave;nh lớn 6.5 inch để bạn thoải m&aacute;i thưởng thức mọi h&igrave;nh ảnh v&agrave; thước phim, giảm t&igrave;nh trạng mỏi mắt. Thiết kế m&agrave;n h&igrave;nh giọt nước tăng kh&ocirc;ng gian hiển thị, c&ugrave;ng độ ph&acirc;n giải&nbsp;<a href=\"https://www.nguyenkim.com/do-phan-giai-man-hinh-hd-fhd-4k-co-y-nghia-nhu-the-nao.html\">m&agrave;n h&igrave;nh HD+</a>&nbsp;t&aacute;i tạo h&igrave;nh ảnh với độ sắc n&eacute;t cao, m&agrave;u sắc ch&acirc;n thực.</p>\r\n\r\n<h3>Chip&nbsp;Unisoc T606, thao t&aacute;c &ecirc;m mượt</h3>\r\n\r\n<p>Nhờ trang bị bộ vi xử l&yacute; Unisoc T606, G11 Plus cho hiệu năng ổn định để xử l&yacute; mượt m&agrave; c&aacute;c t&aacute;c vụ học tập, c&ocirc;ng việc, chơi game th&ocirc;ng thường. Bộ nhớ trong 64GB cho bạn kh&ocirc;ng gian lưu trữ h&igrave;nh ảnh, dữ liệu thoải m&aacute;i.</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus hiệu năng mạnh mẽ\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-5.jpg\" style=\"width:100%\" /></p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus camera kép chụp ảnh đẹp\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-6.jpg\" style=\"width:100%\" /></p>\r\n\r\n<h3>Camera k&eacute;p trang bị c&aacute;c t&iacute;nh năng l&agrave;m đẹp</h3>\r\n\r\n<p>Ghi lại mọi khoảnh khắc trong cuộc sống th&ocirc;ng qua những bức ảnh to&agrave;n cảnh, cận cảnh hay ch&acirc;n dung của bản th&acirc;n đẹp tự nhi&ecirc;n, sắc n&eacute;t với G11 Plus. Bởi m&aacute;y trang bị camera k&eacute;p&nbsp;50MP - 2MP k&egrave;m đ&egrave;n flash ph&iacute;a sau, ph&iacute;a trước l&agrave; camera Selfie 8MP gi&uacute;p bạn tự tay s&aacute;ng tạo những khung ảnh đẹp ấn tượng.</p>\r\n\r\n<h3>Mở kh&oacute;a v&acirc;n tay, mở kh&oacute;a khu&ocirc;n mặt&nbsp;</h3>\r\n\r\n<p>D&ugrave; c&oacute; mức gi&aacute; hết sức b&igrave;nh d&acirc;n nhưng G11 Plus được Nokia trang bị cả 2 c&ocirc;ng nghệ ti&ecirc;n tiến c&oacute; tr&ecirc;n c&aacute;c d&ograve;ng điện thoại Flagship cao cấp đ&oacute; l&agrave; Cảm biến v&acirc;n tay v&agrave; Nhận diện khu&ocirc;n mặt để bạn mở kh&oacute;a nhanh ch&oacute;ng, an to&agrave;n, tăng cường bảo mật cho thiết bị c&aacute; nh&acirc;n của m&igrave;nh.</p>\r\n\r\n<p><img alt=\"Điện thoại Nokia G11 Plus mở khóa vân tay và khuôn mặt\" src=\"https://cdn.nguyenkimmall.com/images/companies/_1/dien-thoai/NOKIA/G11%20Plus/g11-plus-8.jpg\" style=\"width:100%\" /></p>', 3590000, '420a6ff7d4729224849b3da401f22b35.jpg', 100, 1100000, 'dien-thoai-nokia-g11-plus-3gb64gb-xam', 'active', 1, 'Xám', 'TFT LCD', 'Android™ 12', 'Unisoc T606 (12 nm)', 'HD+ (720 x 1600) pixels', '8MP, FF (f/2.0)', '50MP Chính AF (f/1.8) + 2MP Chiều sâu FF', '3 GB', '64 GB', 'Nano', '5000 mAh', 3, '2023-05-07 06:40:50', '2023-05-14 13:58:15');
